(1, 'Is your Daily Commute Harming your Health?', 'is-your-daily-commute-harming-your-health', 1, '<h1>How is my commute damaging my health?</h1>\r\nMillions of us commute to and from work every day. It can be a stressful experience with the average total commute being 56 minutes nationwide.  However, in London we spend 1.5 hours commuting to and from work everyday with this increasing as we work and live even further apart.\r\n\r\nHere\'s how commuting habits can harm your health:\r\n\r\nDiet &ndash; If you&rsquo;re out of the house early ready for your lengthy commute to work, and back late, it&rsquo;s likely you are cutting time from somewhere.  Often, it&rsquo;s your diet that suffers.  Evidence has shown that many people use their daily commute as a time to consume snacks, from unhealthy coffees and bacon sandwiches in the morning to chocolate, crisps and soft drinks laden with sugar in the evenings. \r\n\r\nMental health &ndash; An often under-estimate effect of a daily commute the damage it can do to someone&rsquo;s mental health. Long term tiredness can make you feel stressed and irritable and the stresses of the journey can also have a toil on your mental health. \r\n\r\nExhaust fumes &ndash; There is evidence to suggest that you will breathe in more pollution sitting in a car during heavy traffic than you would if you are outside.  Dirty exhaust fumes get sucked into the car through the air filters and get trapped in the car.  The Royal College of Physicians state that pollution is responsible for 40,000 early deaths per year In the UK.\r\n\r\nWasted time &ndash; Finally, with so much time spent travelling to and from the workplace, it&rsquo;s often exercising that is cut-back to allow time for the daily routine.  Research has shown that those performing a daily commute to their workplace are likely to have a less active lifestyle away from the office.\r\n\r\n<h1>Can I make my commute healthy?</h1>\r\nWe now know that our commute can be incredibly unhealthy for our body and mind, but what can we do about it? \r\n\r\nCycle or walk to work &ndash; This may not be an option for everyone, but if possible, why not explore the option of walking or cycling to work, certainly during the warmer months of the year. Many employers now offer a cycle to work scheme which can help cover some of the cost of buying a bicycle, for example, while many modern office blocks also have shower and changing facilities for staff that need them. So, if you&rsquo;re within a reasonable distance of your workplace, leave the car at home and get your day off to a healthy start.\r\n\r\nEven if you&rsquo;re a little unfit, or based too far from the office to cycle or walk, see if you can get off the bus a few stops earlier or park a little further away from the office so you can start building in some exercise to your daily routine.\r\n\r\nWork flexible &ndash; An increasing number of employers are now offering staff flexible working.  At the very least, this should allow you to vary the hours you work a little which can reduce your commuting time (travelling outside of peak times) and vitally, giving you more time in the evenings or morning to be more active. You could fit in a run, go for a swim or join a gym.  It may even be that you can work from home for one or two days of the week, giving you less time commuting and more time to explore getting out and doing some extra activity. \r\n\r\nSpeak to employers &ndash; Here in the UK, the past decade has seen companies begin to implement health at work policies.  In addition to cycle to work schemes, fruit in the office and shower facilities, they may have benefits in the form of reduced gym memberships or similar.  At the very least, ask your employer what they may be able to do to help counter your unhealthy commute. \r\n\r\nImprove your diet &ndash; For some people, there will be no alternative options when it comes to commuting, so it&rsquo;s a case of doing what you can.  If you drive, make sure you have no unhealthy snacks available to you.  Try and get up a few minutes earlier and grab a proper breakfast, or if you must snack, fill your car with healthier options such as fruit, nuts and seeds.\r\n\r\n<h1>Other Actions to Take</h1>\r\nYou can also try these simple measures when you get to work to try and counteract the detrimental effects of the commute:\r\n\r\nAlways take the stairs &ndash; If you work a couple of floors up in a building, try cutting down on using the elevator and take the stairs.  Even if you&rsquo;re located on the 30th floor, start by getting out on the 28th and walking up two levels by stairs.  These small changes are a good start, and you can increase the floors you cover by stairs as and when you get fitter.\r\n\r\nDon&rsquo;t ride the escalators, walk them &ndash; If you&rsquo;re getting the train to work and use escalators daily, then try walking up and down them rather than simply riding them.\r\n\r\n<em><strong>Go speak to someone</strong></em> &ndash; rather than calling a colleague on the telephone, get in to the habit of going to speak to them at their desk. This tiny change can not only help your fitness and health, it could also help working relationships and communication!\r\n\r\nWith our commutes getting increasingly longer, it&rsquo;s important to be aware of the potential adverse effects that our health can suffer and how to try and mitigate some of these ill-effects.', 'blog-placeholder.jpg', '2017-11-14 03:35:04', 'yes', 'The daily commute to and from work can be incredibly tiring and frustrating, not to mention time-consuming. But could it also be harming your health?\r\n\r\nWell, the research from numerous scientists and health experts from around the world certainly suggests so. From the hours of inactivity to the passive inhalation of vehicle exhaust fumes, your daily commute could be the most damaging aspect of your health.', '', '', '0000-00-00 00:00:00'),
(2, 'Everything you need to know about Eczema / Dermatitis', 'everything-you-need-to-know-about-eczema-dermatitis', 1, '<h1>What is eczema?</h1>\r\nThere are two main types of eczema, atopic and contact. Atopic eczema is usually found in folds of skin, such as arm pits, behind knee caps in on the joints of your arm. Atopic eczema is common in individuals who have either a personal or family history of hay fever or asthma as &ldquo;atopy&rdquo; often runs in families.  The second type is called contact eczema and this most commonly occurs on the hands and feet.\r\n\r\nEczema affects the skin and is inflammatory, causing the skin to become dry, red, itchy and cracked which in turn can lead to further problems and discomfort.\r\n\r\nEczema commonly affects young children at an early age but will often disappear within a year or so, or perhaps as the child reaches teenage years. It can also persist for a longer period of time and in some cases sufferers may not have any symptoms until they reach adulthood.  In some cases, individuals develop eczema in later years.\r\n\r\nFor some however, the condition will be with them long-term, possibly for the duration of their life, and can lead to a lot of discomfort and frustration.\r\n\r\nA study in 2009 suggested that cases of eczema were on the rise, increasing by some 40% in the previous four years. It is still not known what exactly causes eczema, nor is there an outright cure for the condition. Atopic eczema is often passed on through generations of a family and sufferers of atopic conditions will often have others in addition to eczema.\r\n\r\n<h1>What are the symptoms of eczema/dermatitis?</h1>\r\n\r\nThe predominant symptom associated with eczema or dermatitis is itching, and the areas of skin affected will also become red, dry, flaky and often cracked. The itching may be limited to just one area of the body, such as an arm or hand, or it may be widespread on feet, legs, hands and other areas. \r\n\r\nThe symptoms will also differ from person-to-person in terms of severity, with some having only minor irritation from the itches and subsequent skin damage, while others will have particularly distressing and long-lasting symptoms. One of the issues with eczema is that the more the sufferer itches the affected area, the worse condition that the skin will then be in.\r\n\r\nEczema can be further complicated due to the deterioration of the affected areas of skin.  If a sufferer itches a lot, skin can become cracked and open which can lead to infected eczema &ndash; which typically requires doctor prescribed treatment.\r\n\r\n<h1>Non-medical treatment of eczema</h1>\r\n\r\nIn addition to purchasing specialist creams and seeing your GP, there are other steps that you can take to relieve symptoms of eczema. Additionally, it may be possible for you to identify things that trigger your eczema, in which case you can take preventative action.\r\nAreas to concentration on that may make a difference include:\r\n\r\n<strong>&bull; Hydration</strong>\r\nDehydration can cause skin to become drier than usual. There is evidence to suggest that a lack of hydration can affect cells in your body and trigger eczema, so you may find that keeping yourself hydrated throughout the day can help with your skin condition.\r\n\r\n<strong>&bull; Clothing</strong>\r\nClothing can also further irritate a sufferers skin, especially if it causes them to become too hot or the fabric itself irritates the skin (e.g. woollen jumpers).  Additionally, if you wear gloves at home or in work for tasks such as washing dishes or doing gardening, then be careful which type you use.  Rubber gloves, for example, have been known to irritate skin and thus worsen eczema.\r\n\r\n&bull; Soaps and shower gels\r\nPay attention to the soaps, hand wash and shower gels that you use each day. Many mainstream soaps and cosmetics actually cause skin to become drier than before using them, despite sometimes claiming to the contrary. Again, it can differ person-to-person, so if you find your skin is regularly dry in the hours after taking a shower, then look for alternative and perhaps medicated alternatives from your local pharmacy.\r\n\r\n&bull; Daily activities\r\nFinally, beware of the impact of routine daily activities can have.  If you wash your hands in work after going to the toilet for example, ensure you dry your hands properly.  Also, frequent washing and drying of hands can make eczema on the hands worse so it is important to use a soap substitute. \r\n\r\n<h1>Medical treatment of eczema</h1>\r\nIf you notice that you have symptoms of eczema, at first you should seek help from your pharmacist who can offer over-the-counter creams and ointments from your local pharmacy. There are many creams available to help moisturise your skin and thus relieve the symptoms of eczema.  However, the effectiveness of each will differ from one patient to the next, so you may need to be prepared to try several before you find one which works best for you.  These emollient creams should be used at least 3-4 times per day &ndash; ensuring that your skin is kept well hydrated through the day.  Some creams can also double up as a soap substitute for showering and washing your hands with.  Many flare-ups of eczema happens when individuals do not use enough of these creams often enough and this is one of the first things that your doctor will recommend for you to do.\r\n\r\nIf your symptoms are quite bad, do not go away within a couple of weeks, or over-the-counter medications have not worked, then it&rsquo;s advisable to see a GP.  A GP will first confirm whether you do have eczema and then possibly prescribe a steroid cream to use on your eczema when it is particularly troublesome.  The GP will normally recommend that you keep on using copious amounts of the emollient creams in addition to any prescribed steroid cream.  \r\n\r\nVery rarely, a GP may have to refer you to a specialist if your eczema is particularly troublesome and not responding to the normal treatment.', 'Eczema_Dermatitis.png', '2017-11-22 04:12:39', 'yes', 'Eczema, which may also be referred to as dermatitis, is a skin condition which affects many people all over the world.  Whether you have it temporarily or all of your life, it can be uncomfortable at best and painful and distressing at worst. For sufferers, there are a selection of treatment methods available to help relieve the symptoms.', '', '', '0000-00-00 00:00:00'),
(3, 'What You Need to Know About Hayfever', 'what-you-need-to-know-about-hayfever', 1, '<h1>What is hay fever?</h1>\r\n\r\nTo understand the ways in which hay fever can be treated, it&rsquo;s important to first know what the condition is and what causes it.\r\n\r\nHay fever is actually an allergic condition that is caused by your body having an allergic reaction to some types of pollen. Pollen is released by all types of plants and trees as part of their reproductive cycle.  This means that those suffering from hay fever most commonly experience symptoms during the spring and summer months when plants and trees come to bloom.\r\n\r\nThe pollen itself is a very fine powder that can cause considerable irritation when it comes in to contact with a sufferer.  Pollen becomes airborne, particularly in the mornings and again at dusk &ndash; this is why some sufferers complain of extreme symptoms first thing in the morning and in the early evening.\r\n\r\nIt is also worth paying attention to the weather forecast which commonly now gives a pollen count for the days ahead. When the pollen count is high, then warm, humid and windy weather conditions may worsen symptoms for many sufferers.\r\n\r\nThe pollen can cause inflammation and irritation of the eyes, nose, throat and sinuses.  Often, sufferers will inhale the pollen without realising.\r\n\r\n<h1>What are the symptoms of hay fever?</h1>\r\n\r\nHay fever is known to cause a range of symptoms in sufferers, and sometimes trigger other conditions.\r\n\r\nSome of the most common symptoms to look out for if you think you may be suffering with hay fever include:\r\n\r\n<ul>Runny or blocked nose</ul>\r\n- Itchy eyes which may become red and watery\r\n- Tickly throat\r\n- Itchy nose and facial areas, include mouth and ears\r\n- Blocked or painful sinuses\r\n- Sneezing and coughing\r\n\r\nIn addition to these, some sufferers may also develop headaches, earache and pain around their temples or forehead.  As a result of the symptoms, sufferers will often become tired as well, meaning that if left untreated, hay fever can thoroughly ruin your summer.\r\n\r\nThere are also potential further issues when hay fever affects those who have other conditions such as asthma and eczema.\r\n\r\nHay fever can often trigger asthma for those people unfortunate enough to have both, and asthma sufferers may then find themselves wheezing and coughing throughout the day as well.  Shortness of breath and a tight feeling in the chest may well accompany this.  You should seek medical attention quickly if you find this happening to you.\r\n\r\nEczema sufferers can also notice hay fever as being a trigger for flare up in their eczema, often brought on by the itchiness caused by the allergic reaction to pollen which then further inflames already sensitive skin when itched.\r\n\r\nAs with any allergic reaction, the severity of the symptoms suffered by people can vary considerably.  Furthermore, even if you&rsquo;re living in the same house as someone else with hay fever, you may both experience symptoms at different times of the day, or even year.\r\n\r\nThankfully, despite the long list of symptoms and the seasonality of hay fever, there are several treatment options available, and speaking with your GP or visiting the pharmacy can get you on the way combatting hay fever.\r\n\r\n<h1>Preventing hay fever</h1>\r\nBefore getting in to the medical treatments of hay fever, there are also some things you can do during hay fever season (generally speaking, March until September) to reduce your exposure to pollen.\r\n\r\nWhile it is hard during the summer months when the weather is warmer, if you&rsquo;re aware that the pollen count is going to be particularly high, you should avoid spending time outdoors when possible.  This includes cutting the grass, playing sports and even being careful of where and when you walk the dog.\r\n\r\nIf you are heading outside, then try to wear sunglasses, and is possible grab a pair of wrap-around glasses that are close to your face to prevent the pollen getting in to your eyes.  Additionally, be careful about drying clothes outside &ndash; they can trap pollen which you will then come in to contact with when you next wear the clothes.\r\n\r\nOther things to try are fitting pollen filters on to air vents in the car and on to your vacuum cleaner and keep your doors and windows closed when possible if you know that pollen counts are high.\r\n\r\n<h1>Treating hay fever</h1>\r\n\r\nWhile we can treat hay fever to ease the symptoms, it&rsquo;s important to be aware that there is currently no cure available. Some people may naturally stop experiences the symptoms of hay fever when they reach a certain age, or through periods of their life.\r\n\r\nThe most-effective way to ease the symptoms of hay fever is to use some antihistamines which can prevent the allergic reaction from occurring, or at least lessen the severity of it.  You&rsquo;ll want to start by trying some over-the-counter medication available from your local pharmacy. Common anti-histamine tablets such as cetirizine, loratidine and chlorphenamine are available without a prescription from your local pharmacy.  Whilst these are often advertised as non-drowsy; they can all make you slightly drowsy due to how they work.\r\n\r\nDepending on the nature of your symptoms, eye drops to stop your eyes being itchy and steroid nasal spray to help with the nasal symptoms of hayfever can also be provided by your pharmacist.\r\n\r\n<h1>What can a doctor do for hay fever?</h1>\r\nFor the vast majority of hay fever sufferers, these over-the-counter remedies will sufficiently ease the symptoms of hay fever, but if your symptoms are not controlled by these measures &ndash; you should see either your own GP or a MedicSpot GP so you can be helped.  The doctor may find it necessary to prescribe a stronger prescription only antihistamine such as fexofenadine or even prescribe a short course of steroid tablets such as prednisolone if your symptoms are particularly bad.\r\n\r\nIf despite these measures and you are still having a horrible time in controlling your hay fever; a GP can refer you to a specialist allergy doctor who can perform allergy testing and possibly prescribe a medication called Grazax.  This is a form of immunotherapy that exposes the sufferer to small amounts of pollen over a long period of time so that the body gets used to grass pollen.  However, this should be considered only as a last resort once all other avenues have been tried.', 'Hay_Fever.jpg', '2017-12-08 05:47:06', 'yes', 'It is estimated that hay fever affected approximately 13 million people in the UK last year. Hay fever is one of those illnesses that can cause sufferers no end of discomfort and inconvenience, especially during the summer months. The good news is that, working alongside a general practitioner, there are now numerous ways of treating this condition, and MedicSpot can help put you on the path to easing those symptoms.', '', '', '0000-00-00 00:00:00'),
(4, 'What\'s a UTI?', 'whats-a-uti', 0, 'A urinary tract infection (UTI) can carry a range of symptoms depending on where the infection is based within the urinary tract. UTIs can be particularly painful and, due to the potential for some to turn serious, in most cases you will be required to receive diagnosis and treatment by a qualified doctor.\r\n\r\n<h1>What are Urinary Tract Infections (UTIs)?</h1>\r\n\r\nIn adults, UTIs are most common in women with some suffering from frequent urinary tract infections. While they are painful and can be incredibly uncomfortable, they can also pass in just a few days.  Others are more serious and can lead to further complications, which is why it&rsquo;s important to seek professional medical help should you suspect you have a UTI.\r\n\r\nIn children, UTIs are also fairly common but are very rarely serious. That said, swift diagnosis and treatment should be sought if you suspect your child has a urinary tract infection.\r\n\r\nEssentially, UTIs can be broken down in to two types.  A lower UTI and an upper UTI.  A lower urinary tract infection is an infection of the bladder (cystitis) or the tube that carries urine out of the body, known as the urethra. An upper urinary tract infection is an infection of the kidneys or the ureter, the tube that carries urine from the kidneys to the bladder.\r\n\r\nOf the two, an upper UTI is most likely to become more serious if left untreated. Serious cases can damage the kidneys permanently or the infection can spread to the bloodstream, both of which can be a huge problem. This the reasons why swift diagnosis and treatment from a doctor is of paramount importance.  Thankfully, upper UTI&rsquo;s are much less common.\r\n\r\nA UTI is generally caused when bacteria infect your urinary tract. The most common way that this happens is when bacteria from the gut enters the urinary tract via the urethra. This can occur for many reasons, including by wiping your bottom or having sex, but often there is no clear way of knowing how the bacteria that caused the urinary tract infection came to be in the urinary tract.\r\n\r\n<h1>Symptoms of a Urinary Tract Infection (UTI)</h1>\r\n\r\nThe symptoms of a Urinary Tract Infection will generally vary depending on which type of UTI it is.  Symptoms of each type are as follows:\r\n\r\n<h3>Lower Urinary Tract Infection</h3>\r\n\r\n- Pain low down in your stomach area\r\n- Needing to urinate more often than usual\r\n- A sudden urge to urinate\r\n- Discoloured, cloudy and possible bloody urine\r\n- Foul-smelling urine\r\n- Discomfort or even pain when urinating\r\n- A general feeling of being unwell\r\n- Fatigue\r\n- Aches\r\n- Still feeling the need to urinate after doing so\r\n\r\n<h3>Upper Urinary Tract Infection</h3>\r\n\r\nSymptoms of the more serious upper urinary tract infection are often less easy for the sufferer to pinpoint as being related to the urinary tract.  They include:\r\n\r\n- Having a high temperature, or fever, of 38C (100.4&ordm;F) or higher\r\n- Having pain in your side or back\r\n- Shivering and chills\r\n- Feeling nauseous\r\n- Being sick\r\n- Finding yourself confused\r\n- Restlessness\r\n- Agitation\r\n \r\n\r\n<h1>Diagnosis of a Urinary Tract Infection\r\n</h1>\r\nIf you suspect you may have a urinary tract infection, it&rsquo;s best to make an appointment to see a doctor immediately.  If you are unable to see your own GP then MedicSpot can help give you convenient and quick access a GP who can confirm you have a UTI and offer you the appropriate treatment. A sample of urine may be needed to help the doctor diagnose a UTI, but in most cases this is not needed &ndash; especially if you are female.\r\n\r\nIf you decide not to seek medical advice immediately, then you should certainly do so if your condition worsens or does not improve after a few days.  It&rsquo;s important that if your symptoms are consistent with an upper urinary tract infection that you seek an appointment with a doctor as soon as possible as many times upper UTI&rsquo;s need careful monitoring in a hospital.\r\n\r\n<h1>Treatment of a Urinary Tract Infection</h1>\r\n\r\nAS UTI&rsquo;s are caused by bacteria, the common treatment for a Urinary Tract Infection is a short course of antibiotics. Males, pregnant women and the elderly may need a longer course of antibiotics which your doctor can advise you about.  Antibiotics such can be cleared up quickly to minimise the risk of infection spreading.\r\n\r\nOrdinarily, the symptoms of a urinary tract infection will pass within a matter of days from starting treatment with antibiotics. This can be as few as 3-5 days, but even if you are feeling better it is important that you complete the full course of medication prescribed to you to ensure that the infection is fully cleared up and the risk of antibiotic resistance is minimised.\r\n\r\nWhile antibiotics are the only medication that will treat the bacterial infection, there are other things that you can do to help relieve the symptoms.  Paracetamol or Ibuprofen can help ease the potential pain and fever caused by the UTI and while keeping yourself hydrated by drinking a lot of water will also help in flushing the infection out.\r\n\r\nIf your symptoms do not clear up within a week of starting a course of medication from your doctor, it may be that the type of bacterial infection you have does not respond to the antibiotics. The infection may have spread further than initially thought, or it could have led to complications elsewhere such as in the kidneys.\r\n\r\nThere is currently very little evidence that suggests cranberry juice/capsules or the regular taking of probiotics can help prevent UTIs. If you suffer from urine infections regularly, speak to your GP about other potential treatments of ways in which you may be able to prevent them from occurring.', 'UTI-e1500883620253.jpg', '2017-12-09 01:31:13', 'yes', 'It&rsquo;s estimated half of all women in the UK will have a UTI at least once in their life, and 1 in 2,000 healthy men will develop one each year.  Therefore we felt it was necessary to help you understand what are UTIs, how can you detect it and what can you do about it if you have been diagnosed.', '', '', '0000-00-00 00:00:00'),
(5, 'A Guide to the NHS for Students', 'a-guide-to-the-nhs-for-students', 2, '<h1>What is the NHS?</h1>\r\n\r\nNHS stands for National Health Service, and as the name suggests, it is the state-run, publicly funded health care service in the UK.  UK citizens qualify for free treatment from the NHS, however those visiting for longer periods from overseas may not. Doctors, dentists, hospitals, opticians and pharmacies are often all run by, or affiliated to, the NHS.\r\n\r\nHaving access to the National Health Service also allows you to access a range of specialists and consultants at facilities across the UK, as well as access to surgery when required for some conditions or injuries. Prescribed medication is also subsidised through the NHS, making treatment affordable with a current cost of &pound;8.60 per prescription &ndash; no matter how expensive the medication actually is.\r\n\r\nThere are other NHS services you can take advantage of, including a telephone line that you can call for advice called on symptoms you are experiencing.  This is called NHS 111. In addition to the helpline, there is also a website on which more information can be sought (www.nhs.uk).  NHS walk-in centres are also now commonplace, allowing you to drop-in to see a doctor or nurse without a pre-arranged appointment. However, you can find yourself hanging around in a waiting room for several hours with waits of 2-4 hours a common occurrence.\r\n\r\n<h1>What is a GP Surgery/Medical Centre?</h1>\r\n\r\nFirstly, GP stands for General Practitioner. GPs are doctors working from 10,000 GP surgeries/medical centres across the UK.  You should register with a NHS GP surgery as a priority when you come to the UK or move cities as GP surgeries have catchment areas.\r\n\r\nIf you have a health complaint or illness, your first step will be to make an appointment with your GP.  He/she can diagnose your problem and either prescribe medication or a method of treatment, or further referral to a specialist at a hospital when required.  A GP should be your first point of contact before seeing a specialist as many specialist doctors will need referral letters from GPs.\r\n\r\n<h1>Where is your closest GP, and what else should you look for?</h1>\r\n\r\nOnce you have arrived in the UK and completed your immigration process, you are then able to register with a local GP. You can search for a local GP through the NHS choices website (www.nhs.uk.)\r\n\r\nOnce you have identified a GP surgery that you&rsquo;re interested in registering with, you should call them and ask whether they are open to new patient registrations.  Additionally, it&rsquo;s worth asking questions such as how long the average wait is to get an appointment with a GP and what the process for making a GP appointment is.  You can also check online reviews of the GP surgery.  You will be asked to take registration documents including photo ID and proof of address to the GP surgery to register.\r\n\r\nWhilst it is recommended that you register with a NHS GP, there are also other services available if you need medical attention. Private GP services do not typically require any pre-registration and can offer you speed and convenience with speaking to a doctor.  MedicSpot is such a service which provides online GP appointments from its network of pharmacies at very short notice across the UK.\r\n\r\n<h1>How much does the NHS cost?</h1>\r\n\r\nWhile the NHS is free to UK citizens, students from overseas will be required to pay for healthcare if they are non-EAA citizens, or no reciprocal healthcare agreement exists between the UK and your country of citizenship.\r\n\r\nIf your stay is going to be less than six months, you should obtain travel insurance that covers you for healthcare while you&rsquo;re travelling to the UK.  If your stay is more than six months, then you will be required to pay a health surcharge during the immigration process.\r\n\r\nFor international students, healthcare in the UK costs &pound;150 per visa, per year.  Beyond 12 months, each additional six month period is charged at &pound;75. Students should complete the necessary sections of the visa application form and ensure that the surcharge has been paid ahead of arriving in the UK. This is done via the surcharge website.\r\n\r\nStudents who are citizens in Australia or New Zealand will not be required to pay for healthcare in the UK, but will still need to complete the process via the health surcharge website.  While the payment you will be required to make will be nil, you will need the unique surcharge reference number that it provides.\r\n\r\nStudents who are citizens in the EU will be entitled to free healthcare with the NHS, but to be eligible you must obtain a European Health Insurance Card (EIHC) before leaving your native country.\r\n\r\n<h1>Should you see your GP or go to A&E?</h1>\r\n\r\nThe term &ldquo;A&E&rdquo; stands for accident and emergency. A&E departments are found in many hospitals around the UK and are incredibly busy, often involving a long wait to see a doctor.  For this reason, it&rsquo;s important to note that you should only go to A&E if your injury or illness is serious or life-threatening.\r\n\r\nYou can utilise services such as calling 111 or visiting your local pharmacy for health advice as you may not need to see a doctor for your ailment.  Otherwise, your best cause of action is to make an appointment with your NHS GP. Appointments can sometimes be made on the same day by telephoning first thing in the morning, but you may also have a wait of several days or weeks until there is availability.  MedicSpot offers short notice GP appointments at an affordable price.', 'International_Student.jpg', '2017-12-09 01:37:07', 'yes', 'For the thousands of international students that will head to the United Kingdom to begin studies at university in the coming months, knowing how to register with an NHS GP will be really important.\r\n\r\nThere is so much to sort out when you decide to study abroad, from enrolling on your course and meeting new people, to finding student housing and possibly even a part-time job. It\'s little surprise that registering with the NHS is one of the last things on your mind so we\'ve compiled a handy guide to get you started.', 'asdasd', 'asdasdas', '0000-00-00 00:00:00'),
(6, 'Navigating Through Sick Notes', 'navigating-through-sick-notes', 1, 'Q) Why do I need a sick note?\r\nSick notes are generally used to show your employer that you are unwell and need time off work.  They can also be used to advice your employer that you need a change in your working hours, work duties or adaptations made at work.  Other organisations such as colleges and Universities may also ask for them, particularly if you perform poorly or miss an exam due to being unwell. \r\n\r\nQ) How long do I need to be ill for before I can get a sick note?\r\nYour NHS GP is only able to provide a sick note if you have been sick for 7 days (5 working days) or more.  If you have been ill for less than that, then you will be asked to fill in and complete a self certification/employee&rsquo;s statement of sickness form available here.\r\n\r\nQ) What if my work insists on having a doctor&rsquo;s note instead of a self-certification form even if it&rsquo;s been less than 7 days?\r\nSome employers do insist on a doctor&rsquo;s note if you&rsquo;ve been sick for less than 7 days.  For this, you will need a private sick note &ndash; something which MedicSpot can help you with.\r\n\r\nQ) Does my employer have to abide by what is written on the sick note?\r\nNo, the sick note provided by the doctor is classified as advice and your employer does not legally need to act on that advice.  However, that said &ndash; it is very rare that your employer goes against the advice of the doctor.\r\n\r\nQ) Do I need a doctor to provide me with a sick note?\r\nYes, it needs to be signed by the doctor &ndash; normally a General Practitioner (GP.)  If you have been in hospital, then you should ask the hospital doctors to provide you with one.\r\n\r\nQ) Is a sick note, fit note, doctor note and a med3 the same thing?\r\nYes, these are all the same thing.  The term &ldquo;fit note&rdquo; replaced &ldquo;sick note&rdquo; in 2010.  The main reason for this change was to try and get people to go back to work even if they can&rsquo;t completely resume their normal duties.  Doctors often call these notes med3s, but their official title is a &lsquo;Statement of Fitness for Work.&rsquo;\r\n\r\nQ) Can sick notes be backdated?\r\nYes, doctors are legally allowed to backdate a sick note.  \r\n\r\nQ) How do I get a sick note?\r\nYou can get in touch with your own NHS GP to get a sick note.  However, if you need a private sick note if you&rsquo;ve been off work for less than 7 days or need a sick note at quick notice, then you can book an appointment with MedicSpot.  Our online doctors can speak with you and email you a sick note the very same day.  There is no additional charge for sick notes or more detailed letters.', 'medicspot_sick_note.png', '2017-12-09 01:41:35', 'yes', 'Navigating through sick notes, fit notes, doctors notes, med3s &ndash; whatever you call them &ndash; can get quite complicated especially if you&rsquo;ve been fortunate enough never to need them.  It can be difficult enough to jump through hoops to figure out if you need a sick note, why you need one or where to get one from at the best of times; let alone when you&rsquo;re feeling unwell.  Here&rsquo;s a handy guide we&rsquo;ve put together for reference.', '', '', '2018-01-04 00:00:00');
