(16, 'MedicSpot Clinic Cricklewood', '6 Cricklewood Broadway', 'Cricklewood', 'NW2 3HD', '020 3937 5656', 'cricklewood@medicspot.co.uk', 'The Cricklewood MedicSpot clinic is located in Greenlight Pharmacy on 6 Cricklewood Broadway, NW2 3HD &ndash; a few doors down from the Co-op food supermarket. We offer a private same day doctor service where you can walk in and see one of our expert doctors or alternatively you can book an appointment online. You can pick up prescriptions straight after the consultation making the whole process quick and simple.', '51.55285', '-0.210386', '6 Cricklewood Broadway, Cricklewood, London NW2 3HD, UK', 'MedicSpot_Clinic_Cricklewood_Consulting_Room.JPG', 'MedicSpot_Clinic_Cricklewood_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Cricklewood_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'Same day private doctor service in Cricklewood, offering walk in GP consultations. Find out more.', 'england/london/camden/cricklewood/cricklewood-clinic', 'MSPOT1', 'Greenlight Cricklewood', '', '', '', ''),
(17, 'MedicSpot Clinic Euston', '62-64 Hampstead Road', 'Euston', 'NW1 2NT', '020 3937 5666', 'euston@medicspot.co.uk', 'The Euston MedicSpot clinic is located in Greenlight Pharmacy at 62 Hampstead Road, NW1 2NT. This clinic is located in the heart of the city centre very close to the famous Euston and Kings Cross train stations. We provide a private GP service where anyone can walk-in and see a doctor instantly. The location of this clinic makes it ideal for those who work in one of the many offices nearby. If you are a tourist sightseeing in central London, this can be an easy way to see a doctor at an affordable price. You can collect your prescriptions instantly after the consultation from the pharmacy. You can book an appointment online or simply walk in and be seen quickly by one of our expert GP&rsquo;s.', '51.5266968', '-0.1384472', '62-64 Hampstead Rd, Kings Cross, London NW1 2NT, UK', 'MedicSpot_Clinic_Euston_Consulting_Room.JPG', 'MedicSpot_Clinic_Euston_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Euston_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'Instant doctor consultation service, based in Euston, London. Find out more here.', 'england/london/camden/euston/euston-clinic', 'MSPOT2', 'Greenlight Pharmacy Euston', '', '', '', ''),
(18, 'MedicSpot Clinic Shepherds Bush', '228-230 Uxbridge Road', 'London', 'W12 7JD', '020 3937 7710', 'shepherdsbush@medicspot.co.uk', 'This MedicSpot walk in GP clinic is located in the consulting room of GreenLight Pharmacy on 228 Uxbridge Road, Shepherd&rsquo;s Bush, W12 7DJ &ndash; very close to Westfield Shopping Centre. Our doctors have already helped many patients who live, work or shop in the area and are looking forward to helping many more. It&rsquo;s preferable if you use our quick online booking system to book before you come, but if you&rsquo;re in the area already and feel unwell &ndash; simply just walk in and be on the road to recovery after seeing one of our doctors. If you are prescribed medicine, this can be collected from pharmacy straight after the consultation.', '51.5058975', '-0.2277367', '228-230 Uxbridge Road, Shepherds Bush, London W12 7JD, United Kingdom', 'MedicSpot_Clinic_Shepherds_Bush_Consulting_Room.JPG', 'MedicSpot_Clinic_Shepherds_Bush_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Shepherds_Bush_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'Walk in to a same day doctor consultation in Shepherds Bush. Find out more about the service here.', 'england/london/hammersmith-fulham/shepherds-bush/shepherds-bush-clinic', 'MSPOT3', 'Greenlight Shepherds Bush', 'england/london/hammersmith-fulham/shepherds-bush', 'england/london/hammersmith-fulham/shepherds-bush/inside-greenlight-pharmacy-at-shepherds-bush', '', ''),
(21, 'MedicSpot Clinic Harrow on the Hill', '18 College Road', '', 'HA1 1BE', '020 3937 9882', 'harrowonthehill@medicspot.co.uk', 'Your Harrow MedicSpot walk in doctor clinic is located in our consultation room at the Keencare Pharmacy on 18 College Street, HA1 1BE &ndash; it is seconds walk from St-Anns Shopping Centre and minutes from Harrow-on-the-Hill Underground Station. It is conveniently located for those who are out shopping, work or live nearby or those who have not registered with a GP. Harrow residents finally have access to world-class healthcare at an affordable price; without the waits.', '51.5801908', '-0.3353198', '18 College Road, Harrow, London HA1 1BE, United Kingdom', 'MedicSpot_Clinic_Harrow_on_the_Hill_GP_Surgery_Outside.jpg', 'MedicSpot_Clinic_Harrow_on_the_Hill_Consulting_Room.JPG', 'MedicSpot_Clinic_Harrow_on_the_Hill_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'Walk in GP service based in Harrow on the Hill. Learn more about the MedicSpot clinic service.', 'england/london/harrow/harrow/harrow-on-the-hill-clinic', 'MSPOT6', 'Keencare Pharmacy Harrow', '', '', '', ''),
(22, 'MedicSpot Clinic Southwark', '9 Upper Ground', 'Southwark', 'SE1 9LP', '020 3937 9884', 'southwark@medicspot.co.uk', 'Just minutes walk from Blackfriars Bridge, our flagship walk in GP Southwark clinic is located conveniently for thousands of residents, tourists and commuters in and around Waterloo, Southwark and Blackfriars. This MedicSpot clinic is located inside Kalmak Chemist, 9 Upper Ground, SE1 9LP. Should you wish to seek medical attention, it&rsquo;s recommended you book an appointment online. However, if you are unable to do this then simply turn up to our MedicSpot clinic from where you will see one of our expert GP&rsquo;s in a matter of minutes. Save time and all the hassle in seeing your regular GP.', '51.508147', '-0.1057661', '9 Upper Ground, Southwark, London SE1 9LP, United Kingdom', 'MedicSpot_Clinic_Southwark_Consulting_Room.JPG', 'MedicSpot_Clinic_Southwark_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Southwark_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'Walk in GP service in Southwark, for a local same day doctor service. Find out more.', 'england/london/southwark/southwark/southwark-clinic', '', '', '', '', '', ''),
(23, 'MedicSpot Clinic Islington', '243 Upper Street', 'Islington', 'N1 1RU', '020 3937 9886', 'islington@medicspot.co.uk', 'If you wish to see a doctor for an instant consultation then come to our walk in MedicSpot clinic in Islington where you will be seen by an skilled GP within minutes. This MedicSpot clinic is located on 243 Upper Street, N1 1RU within the Rose Chemist which can be found next door to Costa. It is a quick and convenient way of being seen by a GP and you can simply collect your prescription on the way out. No pre-booking required, although it is recommended.', '51.545105', '-0.103492', '243 Upper Street, Islington, London N1 1RU, United Kingdom', 'MedicSpot_Clinic_Islington_consulting_room.JPG', 'MedicSpot_Clinic_Islington_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Islington_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'Walk in doctor\'s clinic in Islington, London, allows you to see an affordable NHS qualified GP on the same day. Learn more.', 'england/london/islington/islington/islington-clinic', 'MSPOT8', 'Rose Chemist Islington', '', '', '', ''),
(24, 'MedicSpot Clinic Barbican', '36 Goswell Road', 'Clerkenwell', 'EC1M 7AA', '020 3937 9909', 'barbican@medicspot.co.uk', 'This Barbican MedicSpot same day doctor clinic is located at 36 Goswell Road, EC1M 7AA &ndash; minutes walk from Barbican Underground Station and the famous Barbican Centre. We offer an affordable and easy private GP service with instant prescription collection. Pre-booking is recommended but you can also just turn up and see a GP straightaway whenever it suits during our opening times.', '51.5227623', '-0.097654', '36 Goswell Road, Clerkenwell, London EC1M 7AA, United Kingdom', 'MedicSpot-Clinic-Barbican-Consulting-Room.jpg', 'MedicSpot_Clinic_Barbican_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Barbican_Virtual_Consultation.JPG', '', 'Walk in GP Service near Barbican, London', '', '', 'Walk in GP and doctor service in Barbican, London, for speedy access to a qualified GP. Find out more.', 'england/london/city-of-london/clerkenwell/barbican-clinic', 'MSPOT9', 'Chauhan Pharmacy Barbican', '', '', '', ''),
(25, 'MedicSpot Clinic Paddington', '107 Praed Street', '', 'W2 1NT', '020 3937 9936', 'paddington@medicspot.co.uk', 'This MedicSpot clinic is located in Apek Pharmacy on 107 Praed Street, W2 1NT &ndash; directly opposite the main entrance of St. Marys Hospital. You can easily get here from Edgware Road and Paddington Underground Stations which are both minutes walk. If you are tired of waiting for weeks for an appointment with your usual GP then this is perfect for you as you just have to turn up at a time that suits and see one of our expert GPs instantly. No pre-booking required!', '51.5172603', '-0.1723911', '107 Praed Street, Paddington, London W2 1NT, United Kingdom', 'MedicSpot_Clinic_Paddington_Consulting_Room.JPG', 'MedicSpot_Clinic_Paddington_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Paddington_Virtual_Consultation.JPG', NULL, NULL, NULL, '', '', 'england/london/westminster/paddington/paddington-clinic', 'MSPOT10', 'Apek Pharmacy', '', '', '', ''),
(26, 'MedicSpot Clinic Earls Court', '240 Earls Court Road', 'Kensington', 'SW5 9AA', '020 3946 3550', 'earlscourt@medicspot.co.uk', 'This clinic is located in Earls Court Chemist on 240 Earls Court Road, SW5 9AA. It is conveniently located exactly two doors down from the Earls Court Underground Station. If you wish to be seen by a doctor straightaway then come into our MedicSpot clinic at a time that suits you. Book online or simply just walk in and ask to see a GP.', '51.4920293', '-0.192987', '240 Earls Court Road, Kensington, London SW5 9AA, United Kingdom', 'MedicSpot_Clinic_Earls_Court_consulting_room.JPG', 'MedicSpot_Clinic_Earls_Court_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Earls_Court_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'Walk in GP consultation service based in Earl\'s Court, London. Affordable same day doctor service - learn more.', 'england/london/kensington-chelsea/kensington/earls-court-clinic', 'MSPOT11', 'Earls Court Chemist', '', '', '', ''),
(27, 'MedicSpot Clinic Holborn', '41 Bloomsbury Way', '', 'WC1A 2SA', '020 3946 3555', 'holborn@medicspot.co.uk', 'Should you wish to seek medical attention, then come and visit our MedicSpot walk in GP clinic in Kerrs Chemist on 41 Bloomsbury Way, WC1A 2SA where you can be seen by a GP within minutes. Our clinic is only minutes away from Holborn Underground Station and Tottenham Court Road Underground Station. Booking an appointment is recommended but you can easily just walk in and be seen by one of our skillful GPs for an affordable price.', '51.5173313', '-0.1248945', '41 Bloomsbury Way, Holborn, London WC1A 2SA, UK', 'MedicSpot_Clinic_Holborn_Consulting_room.JPG', 'MedicSpot_Clinic_Holborn_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Holborn_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'Walk in doctor service in Holborn. See a doctor on the same day - learn more here.', 'england/london/camden/holborn/holborn-clinic', 'MSPOT12', 'Kerrs Chemist', 'england/london/camden/holborn', '', '', ''),
(28, 'MedicSpot Clinic Glasgow Centre', '128 High Street', 'Glasgow', 'G1 1PQ', '0141 406 5808', 'glasgowcentre@medicspot.co.uk', 'The Glasgow City Centre MedicSpot Walk In GP Clinic is located at 128 High Street, G1 1PQ inside Glasgow High Street Pharmacy &ndash; just at the end of Ingram Street next door to Aldi. We offer convenient and affordable private GP consultations with prescriptions to patients in surrounding areas such as Paisley and Clydebank in addition to Glasgow. You can either pre-book or you can choose to turn up and see the doctor at a time whenever it suits. There is good wheelchair access at this clinic.', '55.859139', '-4.240898', '128 High St, Glasgow G1 1PQ, UK', 'MedicSpot_Clinic_Glasgow_Centre_Consulting_Room.JPG', 'MedicSpot_Clinic_Glasgow_Centre_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Glasgow_Centre_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'Affordable walk in GP consultation service, based in Glasgow city centre. Find out more.', 'scotland/glasgow/glasgow/glasgow-centre-clinic', 'MSPOT13', 'High Street Pharmacy Glasgow', 'scotland/glasgow/glasgow-centre/glasgow-centre-clinic', '', '', ''),
(29, 'MedicSpot Clinic Willesden', '70-72 Walm Lane', 'Willesden', 'NW2 4RA', '020 3946 3599', 'wilesden@medicspot.co.uk', 'This MedicSpot clinic walk in GP service is located inside Craig Thompson Pharmacy at 70-72 Walm Lane, NW2 4RA &ndash; few minutes walk from Willesden Green Station and Sainsbury&rsquo;s local. It is perfect for residents and commuters who want to be seen by a GP immediately without having to wait days for an appointment. You can walk in, be seen by a doctor and leave with your prescription. It&rsquo;s as simple as that.', '51.548275', '-0.221969', '70-72 Walm Ln, Willesden, London NW2 4RA, UK', 'MedicSpot_Clinic_Wilesden_Consulting_Room.JPG', 'MedicSpot_Clinic_Wilesden_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Wilesden_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'Local walk in and same day doctor consultations in Willesden. Learn more here.', 'england/london/brent/wilesden/wilesden-clinic', '', '', '', '', '', ''),
(30, 'MedicSpot Clinic Notting Hill', '12 Pembridge Road', 'Notting Hill', 'W11 3HL', '020 3946 3661', 'nottinghill@medicspot.co.uk', 'This MedicSpot walk in doctor clinic is located inside Notting Hill Pharmacy &ndash; 12 Pembridge Road, W11 3HL &ndash; couple of minutes from Notting Hill Gate Underground Station. The clinic is very close to Hyde Park and Kensington Gardens. We provide a high-quality GP service where you canwalk in and be seen by a doctor within minutes. Prescriptions can be picked up instantly on your way out after your MedicSpot consultation.', '51.509462', '-0.196981', '12 Pembridge Rd, Notting Hill, London W11 3HL, UK', 'MedicSpot_Clinic_Nothing_Hill_Virtual_Consultation.JPG', 'MedicSpot_Clinic_Notting_Hill_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Notting_Hill_walk_in_centre_inside.JPG', NULL, NULL, NULL, '', 'Walk in doctor and same day GP service in the Notting Hill area. Find out more about the service here.', 'england/london/kensington-chelsea/notting-hill/notting-hill-clinic', 'MSPOT15', 'Notting Hill Pharmacy', '', '', '', ''),
(31, 'MedicSpot Clinic South Kensington Station', '6 South Kensington Station Arcade', 'Kensington', 'SW7 2NA', '020 3946 3663', 'southkensingtonstation@medicspot.co.uk', 'This Kensington MedicSpot walk in GP clinic is conveniently located inside South Kensington Underground Station. The location of this clinic makes it ideal for those who use the station to commute or residents who do not want to wait long for an appointment with their normal doctor. You can simply book an appointment online using our quick booking system or just walk in and ask to see a doctor. Prescriptions can be picked up directly from the pharmacy after the consultation making for a fast and easy process.', '51.4941275', '-0.1740792', '6 S Kensington Station Arcade, Kensington, London SW7 2NA, UK', 'MedicSpot_Clinic_South_Kensington_Station_Consulting_Room.JPG', 'MedicSpot_Clinic_South_Kensington_Station_Virtual_Consultation.JPG', 'MedicSpot_Clinic_South_Kensington_walk_in_centre_inside.JPG', NULL, NULL, NULL, '', 'Situated within South Kensington station, this MedicSpot clinic provides a same day doctor service. Learn more.', 'england/london/kensington-chelsea/kensington/south-kensington-station-clinic', 'MSPOT16', 'Sticklands Pharmacy', '', '', '', ''),
(32, 'MedicSpot Clinic Isleworth', '1 Shrewsbury Walk', '', 'TW7 7DE', '020 3917 6896', 'isleworth@medicspot.co.uk', 'Our MedicSpot walk in GP service Clinic Isleworth is located inside Riverside Pharmacy which is an extended hour pharmacy - open until 22.30 each day.  It\'s located in the Woodlands area near West Middlesex Hospital on the junction of South Street and Shrewsbury Walk.  If you need a quick GP appointment, then simply book online and then go to the pharmacy to be instantly connected to one of our expert doctors.', '51.4682881', '-0.325005', '1 Shrewsbury Walk, Isleworth TW7 7DE, UK', 'MedicSpot_Clinic_Isleworth_Consulting_Room.JPG', 'MedicSpot_Clinic_Isleworth_GP_Surgery_Outside.jpg', 'MedicSpot_Clinic_Isleworth_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'AFfordable same day doctor service in Isleworth, Middlesex. Find out more here.', 'england/london/hounslow/isleworth/isleworth-clinic', '', '', '', '', '', ''),
(33, 'MedicSpot Clinic Mayfair', '6 Shepherd Market', 'Mayfair', 'W1J 7QD', '020 3946 3665', 'mayfair@medicspot.co.uk', 'Your Mayfair MedicSpot walk in GP clinic is located in the pharmacy at 6 Shephard Market, W1J 7QD which is very close to Green Park, Hyde Park Corner and the famous Piccadilly Circus underground stations. It is only a few minutes walk from the iconic Dorchester Hotel. If you live, work or are sightseeing nearby and wish to see a GP then come to our Mayfair clinic where you will be seen by a doctor within minutes. Prescriptions are simply collected directly from the pharmacy directly after the consultation.', '51.506445', '-0.146193', '6 Shepherd Market, Mayfair, London W1J 7QD, UK', 'MedicSpot_Clinic_Mayfair_Consulting_Room.JPG', 'MedicSpot_Clinic_Mayfair_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Mayfair_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'Walk in GP clinic in Mayfair, provides an affordable same day doctor service to the local area. Learn more.', 'england/london/westminster/mayfair/mayfair-clinic', 'MSPOT17', 'The Pharmacy at Mayfair', '', '', '', ''),
(34, 'MedicSpot Clinic Clapham', '31 Clapham High Street', 'Clapham', 'SW4 7TR', '020 3946 3667', 'clapham@medicspot.co.uk', 'The Clapham Medicspot walk in doctor\'s clinic at 31 Clapham High Street, SW4 7TR is located adjacent to Sainsbury&rsquo;s Local &ndash; just minutes away from Clapham North and Clapham Common underground stations. Our expert doctors have already helped many patients who live or work in the area. With great feedback, we aim to treat many more in the area. If you are tired of having to wait weeks for an appointment then come see one of our doctors for an affordable price. Like all of our MedicSpot clinics, this clinic is wheelchair accessible.', '51.4642822', '-0.1310743', '31 Clapham High St, Clapham, London SW4 7TR, UK', 'MedicSpot_Clinic_Clapham_consulting_room.JPG', 'MedicSpot_Clinic_Clapham_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Clapham_Virtual_Consultation.JPG', 'MedicSpot Clinic Clapham', 'MedicSpot Clinic Clapham', 'MedicSpot Clinic Clapham', '', 'Visit a qualified GP on the same day in Clapham, London. Find out more about the service here.', 'england/london/lambeth/clapham/clapham-clinic', 'MSPOT18', 'Pearl Pharmacy', '', '', '', ''),
