(56, 'MedicSpot Clinic Tufnell Park', '165 Fortess Road', 'Kentish Town', 'NW5 2HR', '02030530578', 'tufnellpark@medicspot.co.uk', 'MedicSpot Clinic Tufnell Park walk in GP service is located right next to Tufnell Park underground station in North London next to Costa Coffee.  This MedicSpot Clinic is located inside D.H Roberts Pharmacy where you can see one of our online doctors and pick up your prescription straight away.  You can either walk in, but it\'s recommended that you book ahead to minimise any waiting time.', '51.5568368', '-0.1386816', '165 Fortess Rd, London NW5 2HR, UK', 'MedicSpot_Clinic_Tufnell_Park_Consulting_Room.JPG', 'MedicSpot_Clinic_Tufnell_Park_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Tufnell_Park_Virtual_Consultation.JPG', NULL, NULL, NULL, '', 'Local walk in GP service in Tufnell Park. Find out how to see a same day doctor here.', 'england/london/camden/kentish-town/tufnell-park-clinic', '', '', '', '', '', ''),
(57, 'MedicSpot Clinic East Kilbride', '37 The Murray Square', 'East Kilbride', 'G75 0BH', '01355 202 221', 'eastkilbride@medicspot.co.uk', 'MedicSpot Clinic East Kilbride is located inside Deans Pharmacy on Murray Square.  If you need a same day GP appointment near you along with treatment - simply book online and see one of our online GPs from the MedicSpot Clinic.  You will be able to pick up your prescription straight away.', '55.753366', '-4.184255', '37 The Murray Square, East Kilbride, Glasgow G75 0BH, UK', 'MedicSpot_Clinic_East_Kilbride_Consulting_Room.JPG', 'MedicSpot_Clinic_East_Kilbride_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_East_Kilbride_Virtual_Consultation.JPG', NULL, '', NULL, '', 'Same day walk in doctor service in East Kilbride. Affordable same day GP service - find out more.', 'scotland/lanarkshire/east-kilbride/east-kilbride-clinic', '', '', '', '', '', ''),
(58, 'MedicSpot Clinic Victoria', '6 Lower Belgrave Street', '', 'SW1W 0LJ', '020 3917 6897', 'victoria@medicspot.co.uk', 'Your MedicSpot Clinic Victoria is located inside Keencare Pharmacy a stones throw away from Victoria Station.  If you need a short notice GP appointment, then simply book online and see one of our GPs instantly.', '51.4963255', '-0.1472679', '6 Lower Belgrave St, Belgravia, London SW1W 0LJ, UK', 'MedicSpot_Clinic_Victoria_Consulting_Room.JPG', 'MedicSpot_Clinic_Victoria_GP_Surgery_Outside.JPG', 'MedicSpot_Clinic_Victoria_Virtual_Consultation.JPG', NULL, '', NULL, '', 'Same day and walk in GP service in Victoria, London. Learn more about the service here.', 'england/london/westminster/belgravia/victoria-clinic', 'MSPOT42', 'Keencare Pharmacy Victoria', '', '', '', '');
