(56, 1, 'teams', '{\"id\":1,\"name\":\"Dr Zubair Ahmed\",\"title\":\"CO-FOUNDER & CEO\",\"bio\":\"Zubair read medicine at the University of Aberdeen and subsequently trained to be a GP and worked as a GP both in England and Scotland. He realised that primary healthcare provision could be made much more efficient and safer through the use of technology; which led to the launch of MedicSpot. He strongly believes that innovation has the potential to increase capacity in our health system whilst also improving the quality of care.\\r\\n<br>\\r\\nDr Ahmed is passionate about solving health challenges that we face through creativity and innovation. He holds a MBA from London Business School.\",\"avatar_image\":\"team-people\\/f-za.png\",\"published\":\"yes\"}', 1, '2017-11-14 10:19:57', 1),
(57, 2, 'teams', '{\"id\":2,\"name\":\"Dr Tarlochan Toor\",\"title\":\"CO-FOUNDER & MEDICAL DIRECTOR\",\"bio\":\"Following his medical studies at Guy&rsquo;s, King&rsquo;s and St Thomas&rsquo;s School of Medicine, Dr Toor completed his medical training at the Leeds Teaching Hospitals before qualifying as a GP. During his time in the NHS, Dr Toor saw first hand the problems faced by the NHS and patients alike. To help further understand the healthcare landscape and how better to deliver world-class healthcare, Dr Toor completed a Master&rsquo;s degree in Health Economics and Financing from the London School of Economics.\\r\\n<br>\\r\\nDr Toor is passionate about embracing technology and innovation to deliver the highest quality, patient-centred healthcare. He is responsible for ensuring MedicSpot has patient experience and safety at its very core.\",\"avatar_image\":\"team-people\\/f-tt.png\",\"published\":\"yes\"}', 1, '2017-11-14 10:21:23', 1),
(58, 3, 'teams', '{\"id\":3,\"name\":\"Oliver Brooks\",\"title\":\"CHIEF TECHNOLOGY OFFICER\",\"bio\":\"Oliver has founded and run companies in different industries ever since graduating from University . He brings with him a wealth of experience in technical know-how, security, marketing and leadership skills to MedicSpot. Oliver feels that technology and innovation has a large role to play in improving our health system and is hoping that MedicSpot leads this change. Oliver holds a MET (Engineering) from Queens&rsquo; College, Cambridge.\",\"avatar_image\":\"team-people\\/f-ob.png\",\"published\":\"yes\"}', 1, '2017-11-14 10:22:36', 1),
(59, 4, 'teams', '{\"id\":4,\"name\":\"Jurek Sikorski\",\"title\":\"\",\"bio\":\"Jurek has extensive experience within the healthcare industry. After founding and exiting Boots-Celltech, Jurek became Sales & Marketing Director at Wellcome Diagnostics and Smith & Company, a FTSE 100 company. He progressed onto CEO roles at biotechnology companies before leading a medical devices start-up to successful IPO.\\r\\n<br>\\r\\nJurek is chairman of several companies and founder of Henley Business Angels.\",\"avatar_image\":\"team-people\\/a-js.png\",\"published\":\"yes\"}', 1, '2017-11-14 10:23:48', 1),
(60, 4, 'teams', '{\"id\":\"4\",\"name\":\"Jurek Sikorski\",\"title\":\"\",\"bio\":\"Jurek has extensive experience within the healthcare industry. After founding and exiting Boots-Celltech, Jurek became Sales & Marketing Director at Wellcome Diagnostics and Smith & Company, a FTSE 100 company. He progressed onto CEO roles at biotechnology companies before leading a medical devices start-up to successful IPO.\\r\\n<br>\\r\\nJurek is chairman of several companies and founder of Henley Business Angels.\",\"avatar_image\":\"team-people\\/a-js.png\",\"published\":\"yes\",\"category_id\":\"4\"}', 2, '2017-11-14 10:25:40', 1),
(61, 2, 'teams', '{\"id\":\"2\",\"name\":\"Dr Tarlochan Toor\",\"title\":\"CO-FOUNDER & MEDICAL DIRECTOR\",\"bio\":\"Following his medical studies at Guy&rsquo;s, King&rsquo;s and St Thomas&rsquo;s School of Medicine, Dr Toor completed his medical training at the Leeds Teaching Hospitals before qualifying as a GP. During his time in the NHS, Dr Toor saw first hand the problems faced by the NHS and patients alike. To help further understand the healthcare landscape and how better to deliver world-class healthcare, Dr Toor completed a Master&rsquo;s degree in Health Economics and Financing from the London School of Economics.\\r\\n<br>\\r\\nDr Toor is passionate about embracing technology and innovation to deliver the highest quality, patient-centred healthcare. He is responsible for ensuring MedicSpot has patient experience and safety at its very core.\",\"avatar_image\":\"team-people\\/f-tt.png\",\"published\":\"yes\",\"category_id\":\"3\"}', 2, '2017-11-14 10:25:57', 1),
(62, 1, 'teams', '{\"id\":\"1\",\"name\":\"Dr Zubair Ahmed\",\"title\":\"CO-FOUNDER & CEO\",\"bio\":\"Zubair read medicine at the University of Aberdeen and subsequently trained to be a GP and worked as a GP both in England and Scotland. He realised that primary healthcare provision could be made much more efficient and safer through the use of technology; which led to the launch of MedicSpot. He strongly believes that innovation has the potential to increase capacity in our health system whilst also improving the quality of care.\\r\\n<br>\\r\\nDr Ahmed is passionate about solving health challenges that we face through creativity and innovation. He holds a MBA from London Business School.\",\"avatar_image\":\"team-people\\/f-za.png\",\"published\":\"yes\",\"category_id\":\"3\"}', 2, '2017-11-14 10:26:09', 1),
(63, 3, 'teams', '{\"id\":\"3\",\"name\":\"Oliver Brooks\",\"title\":\"CHIEF TECHNOLOGY OFFICER\",\"bio\":\"Oliver has founded and run companies in different industries ever since graduating from University . He brings with him a wealth of experience in technical know-how, security, marketing and leadership skills to MedicSpot. Oliver feels that technology and innovation has a large role to play in improving our health system and is hoping that MedicSpot leads this change. Oliver holds a MET (Engineering) from Queens&rsquo; College, Cambridge.\",\"avatar_image\":\"team-people\\/f-ob.png\",\"published\":\"yes\",\"category_id\":\"3\"}', 2, '2017-11-14 10:26:23', 1),
(64, 5, 'teams', '{\"id\":5,\"name\":\"Jacques de Cock\",\"title\":\"\",\"bio\":\"Jacques has over 20 years experience in global consulting, technology, business creation and management. He is a founding director of Spicer and Openheim consultants and was CEO of Patsystems which he took from a 6 man start-up to a &pound;200m IPO in 3 years.\\r\\n<br>\\r\\nHe is currently CEO and partner at a business services firm, early stage advisory and a financial services consulting company. Jacques is also a trustee of 2 charities.\",\"avatar_image\":\"team-people\\/a-jq.png\",\"published\":\"yes\",\"category_id\":\"4\"}', 1, '2017-11-14 10:27:36', 1),
(65, 6, 'teams', '{\"id\":6,\"name\":\"Dr Zubair Ahmed\",\"title\":\"MBChB mRCGP MBA\",\"bio\":\"Dr Ahmed has been a doctor for 10 years after obtaining his medical degree from the University of Aberdeen, Scotland. He worked across a wide array of specialities including cardiology, accident and emergency, geriatrics before focusing his energies in becoming a General Practitioner. Dr Ahmed is very excited about how technology can help both doctors and patients alike.\",\"avatar_image\":\"team-people\\/f-za.png\",\"published\":\"yes\",\"category_id\":\"5\"}', 1, '2017-11-14 10:28:42', 1),
(66, 11, 'fuel_pages', '{\"id\":11,\"location\":\"team\",\"layout\":\"teams\",\"published\":\"yes\",\"cache\":\"yes\",\"date_added\":\"2017-11-14 02:41:39\",\"last_modified\":\"2017-11-14 02:41:39\",\"last_modified_by\":\"\",\"variables\":[{\"id\":\"157\",\"page_id\":\"11\",\"name\":\"body\",\"scope\":\"\",\"value\":\"Our founders have all worked in the NHS and seen first hand the problems that the NHS and patients face. Through no fault of its own, the NHS is struggling to cope with rising demand from demographic shifts, more complex disease and a funding squeeze.\\r\\n<br>\\r\\nFar from trying to be a substitute for the NHS, MedicSpot hopes to complement the NHS to ensure that patients get care high quality at a time and place of their choosing. This will improve patient experience and outcomes &ndash; leading to a healthier nation.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"teams\",\"location\":\"team\",\"page_published\":\"yes\"},{\"id\":\"158\",\"page_id\":\"11\",\"name\":\"body_class\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"teams\",\"location\":\"team\",\"page_published\":\"yes\"},{\"id\":\"156\",\"page_id\":\"11\",\"name\":\"heading\",\"scope\":\"\",\"value\":\"MedicSpot is a Healthcare Company that Aims to Revolutionise the Patient Journey.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"teams\",\"location\":\"team\",\"page_published\":\"yes\"},{\"id\":\"154\",\"page_id\":\"11\",\"name\":\"meta_description\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"teams\",\"location\":\"team\",\"page_published\":\"yes\"},{\"id\":\"155\",\"page_id\":\"11\",\"name\":\"meta_keywords\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"teams\",\"location\":\"team\",\"page_published\":\"yes\"},{\"id\":\"153\",\"page_id\":\"11\",\"name\":\"page_title\",\"scope\":\"\",\"value\":\"team\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"teams\",\"location\":\"team\",\"page_published\":\"yes\"}]}', 1, '2017-11-14 10:41:39', 1),
