(68, 12, 'fuel_pages', '{\"id\":12,\"location\":\"reviews\",\"layout\":\"reviews\",\"published\":\"yes\",\"cache\":\"yes\",\"date_added\":\"2017-11-14 03:01:35\",\"last_modified\":\"2017-11-14 03:01:35\",\"last_modified_by\":\"\",\"variables\":[{\"id\":\"163\",\"page_id\":\"12\",\"name\":\"body\",\"scope\":\"\",\"value\":\"We are passionate about making basic healthcare more efficient, convenient & safe to everyone and we believe we do a good job at bringing this passion to life.\\r\\n<br>\\r\\nBut don&rsquo;t take our word for it. Here&rsquo;s what some of our regular customers have to say about us.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"reviews\",\"location\":\"reviews\",\"page_published\":\"yes\"},{\"id\":\"164\",\"page_id\":\"12\",\"name\":\"body_class\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"reviews\",\"location\":\"reviews\",\"page_published\":\"yes\"},{\"id\":\"162\",\"page_id\":\"12\",\"name\":\"heading\",\"scope\":\"\",\"value\":\"Reviews\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"reviews\",\"location\":\"reviews\",\"page_published\":\"yes\"},{\"id\":\"160\",\"page_id\":\"12\",\"name\":\"meta_description\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"reviews\",\"location\":\"reviews\",\"page_published\":\"yes\"},{\"id\":\"161\",\"page_id\":\"12\",\"name\":\"meta_keywords\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"reviews\",\"location\":\"reviews\",\"page_published\":\"yes\"},{\"id\":\"159\",\"page_id\":\"12\",\"name\":\"page_title\",\"scope\":\"\",\"value\":\"Reviews\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"reviews\",\"location\":\"reviews\",\"page_published\":\"yes\"}]}', 1, '2017-11-14 11:01:35', 1),
(69, 1, 'faqs', '{\"id\":1,\"question\":\"What is MedicSpot?\",\"answer\":\"MedicSpot allows you to see one of our online GP&rsquo;s from the comfort of your pharmacy&rsquo;s private consulting room via video-link (like over Skype or FaceTime). You will be able to see one of our doctors in a matter of minutes without even needing to make an appointment. With MedicSpot you can finally fit your doctor visits around your timetable!\",\"published\":\"yes\"}', 1, '2017-11-14 11:10:05', 1),
