(82, 7, 'teams', '{\"id\":7,\"name\":\"Saleem Arif\",\"title\":\"\",\"bio\":\"Saleem founded QualitySolicitors, the UK&rsquo;s first and largest legal brand with several hundred branches nationwide and now making up 5% of the entire private client legal market. Prior to founding QualitySolicitors, Saleem worked as a marketing consultant at McKinsey & Company and an equities broker at Merrill Lynch.\\r\\n\\r\\nSaleem read Economics and Cambridge and has a MBA from London Business School.\",\"avatar_image\":\"team-people\\/a-sa.png\",\"published\":\"yes\",\"category_id\":\"4\"}', 1, '2017-11-22 09:30:57', 1),
(83, 8, 'teams', '{\"id\":8,\"name\":\"Nicholas Ibery\",\"title\":\"\",\"bio\":\"Nicholas is a co-founder and a senior advisor to MedicSpot. He is an investor with a particular interest in life sciences, focusing on social impact and sustainable investments. Nicholas holds degrees and postgraduate qualification in both medicine and law. He holds bachelors degrees in Medicine and LL.B in Law, specialising in corporate legal practice, Master&rsquo;s degree from the Imperial College and MBA from London Business School.\",\"avatar_image\":\"team-people\\/a-ni.png\",\"published\":\"yes\",\"category_id\":\"4\"}', 1, '2017-11-22 09:32:44', 1),
(84, 9, 'teams', '{\"id\":9,\"name\":\"Dr Tarlochan Toor\",\"title\":\"MBBS BSc(Hons) MSc MRCGP\",\"bio\":\"Dr Toor graduated from Guy&rsquo;s, King&rsquo;s and St Thomas&rsquo; School of Medicine during which time he also completed an Intercalated BSc in Physiology. He completed his GP Training in Yorkshire and remained actively involved in teaching. He served as a Mentor to medical students and was appointed to Visiting Lecturer at the University of Leeds during his training.\\r\\n\\r\\nHe continues to serve as an NHS GP from his central London practice. He has a passion for Digital Health and hopes to continue in his resolve to provide the highest quality care using innovation and technology.\",\"avatar_image\":\"team-people\\/d-tt.png\",\"published\":\"yes\",\"category_id\":\"5\"}', 1, '2017-11-22 09:34:15', 1),
(85, 10, 'teams', '{\"id\":10,\"name\":\"Dr Faiza Khalid\",\"title\":\"Med Sci (Hons) MB ChB MRCGP PGCME\",\"bio\":\"Dr Khalid has 12 years of experience as a GP. Born and raised in the Home Counties, she pursued her passion for medical sciences at The University of Leeds. She proceeded to read her degree in Medicine at The Leicester-Warwick Medical School. In addition to being a GP, she is also a qualified GP trainer and thus mentors doctors wishing to pursue a career in General Practice.\",\"avatar_image\":\"team-people\\/d-fk.png\",\"published\":\"yes\",\"category_id\":\"5\"}', 1, '2017-11-22 09:36:01', 1),
(86, 11, 'teams', '{\"id\":11,\"name\":\"Dr Wasif Razzaq\",\"title\":\"MBChB mRCGP\",\"bio\":\"Dr Razzaq is a GP based in the North East of England. He has extensive experience across many different hospital specialities including cardiology and paediatrics.\\r\\n\\r\\nHowever, Dr Razzaq loves the variety encountered as a GP and enjoys providing a holistic management plan for his patients.\",\"avatar_image\":\"team-people\\/d-wr.png\",\"published\":\"yes\",\"category_id\":\"5\"}', 1, '2017-11-22 09:37:05', 1),
(87, 12, 'teams', '{\"id\":12,\"name\":\"Dr David Eckersall\",\"title\":\"MBChB mRCGP\",\"bio\":\"Dr Eckersall attended Aberdeen Medical School, Scotland and subsequently completed his GP training in Newcastle. Whilst he greatly enjoyed his time in hospital working across various specialities, Dr Eckersall enjoyed the variety and holistic approach seen in general practice. Dr Eckersall is also a GP partner at a training practice in Lanarkshire, Scotland.\",\"avatar_image\":\"team-people\\/d-de.png\",\"published\":\"yes\",\"category_id\":\"5\"}', 1, '2017-11-22 09:38:20', 1),
