(97, 2, 'reviews', '{\"id\":2,\"name\":\"Kelly\",\"desc\":\"I had a great experience! The doctor was very courteous and friendly, and I was able to get a prescription filled right then and there.\",\"avatar_image\":\"kelly.png\",\"published\":\"yes\"}', 1, '2017-11-22 15:03:36', 1);
INSERT INTO `fuel_archives` (`id`, `ref_id`, `table_name`, `data`, `version`, `version_timestamp`, `archived_user_id`) VALUES
(98, 2, 'faqs', '{\"id\":\"2\",\"question\":\"Is There A Cost For This?\",\"answer\":\"MedicSpot is a private GP service and hence there is a &pound;39 fee per consultation. Your consultation will typically last 10-15 minutes, but we don&rsquo;t charge extra if we take longer in dealing with your health complaint. We have kept our fees deliberately affordable as we recognise that we can help many more patients like you by giving them a safe, affordable and convenient alternative to their NHS GP surgery. Any medication that your MedicSpot doctor recommends will be issued as a paid-for private prescription that will be ready for collection on the way out.\",\"published\":\"yes\"}', 2, '2017-11-22 15:39:23', 1),
(99, 3, 'faqs', '{\"id\":\"3\",\"question\":\"What Can MedicSpot Help With?\",\"answer\":\"MedicSpot can successfully complete 95% of consultations.  In addition to providing diagnosis, treatment and prescriptions; MedicSpot can also issue sick notes, referral letters and general healthcare advice.\",\"published\":\"yes\"}', 2, '2017-11-22 15:40:33', 1),
(100, 4, 'faqs', '{\"id\":4,\"question\":\"What happens if the doctor needs to examine me?\",\"answer\":\"Our state-of-the-art MedicSpot Clinical Station allow the doctor to perform various examinations on you just as your normal GP would do. The doctor will guide you what you need to do, but a pharmacy staff member is always available to give you a helping hand if needed.\",\"published\":\"yes\"}', 1, '2017-11-22 15:41:04', 1),
(101, 5, 'faqs', '{\"id\":5,\"question\":\"Who are your doctors?\",\"answer\":\"All of our doctors are hand-picked UK based General Practitioners (GP&rsquo;s) registered and regulated by the General Medical Council. In addition, MedicSpot is registered and regulated by the Care Quality Commission to ensure we meet the fundamental standards of safe and quality healthcare provision in the UK.  You can find out more about our doctors by going to the about us page.\",\"published\":\"yes\"}', 1, '2017-11-22 15:43:27', 1),
(102, 6, 'faqs', '{\"id\":6,\"question\":\"Shall I tell my regular GP that I used MedicSpot?\",\"answer\":\"At the start of each consultation, you will be asked whether you want a copy of your records to go to your normal NHS GP.  We encourage this to promote better continuity of care, but the decision is ultimately up to you.\",\"published\":\"yes\"}', 1, '2017-11-22 15:45:20', 1),
(103, 6, 'faqs', '{\"id\":\"6\",\"question\":\"Shall I tell my regular GP that I used MedicSpot?\",\"answer\":\"At the start of each consultation, you will be asked whether you want a copy of your records to go to your normal NHS GP.  We encourage this to promote better continuity of care, but the decision is ultimately up to you.  \\r\\n\\r\\nMedicSpot is designed to be used in addition to your normal GP, not as a substitute.\",\"published\":\"yes\"}', 2, '2017-11-22 15:45:56', 1),
(104, 7, 'faqs', '{\"id\":7,\"question\":\"Can I use MedicSpot if I am not a resident of the UK?\",\"answer\":\"Yes, MedicSpot can be used by anyone, even if they are visiting the UK temporarily as tourist.  We also see many patients who have moved to the UK, but who have not yet been able to register with a NHS GP.\",\"published\":\"yes\"}', 1, '2017-11-22 15:50:54', 1),
(105, 8, 'faqs', '{\"id\":8,\"question\":\"What conditions is MedicSpot not suitable for?\",\"answer\":\"It is important to know that MedicSpot is not an emergency medical service and you should contact your local emergency services or attend accident & emergency if you feel that your condition is an emergency.  These include things such as suspected heart attack or severe chest pain, neurological deficit or suspected stroke or seizures, severe or heavy bleeding, severe or sudden onset of pain, severe mental health issues such as thoughts of self harm, suicide or psychosis, pregnancy related complications, major trauma on any part of the body or unrelenting high fever.\",\"published\":\"yes\"}', 1, '2017-11-22 15:56:56', 1),
(106, 9, 'faqs', '{\"id\":9,\"question\":\"Do I need to buy my prescription from the same pharmacy I\'ve used MedicSpot from?\",\"answer\":\"Whilst the vast majority of our patients get the prescription from the MedicSpot pharmacy, you are well within your rights to take your prescription to any other pharmacy. Just let the pharmacist know and you will be told on how to do this. It&rsquo;s simple!\",\"published\":\"yes\"}', 1, '2017-11-22 15:59:07', 1),
(107, 10, 'faqs', '{\"id\":10,\"question\":\"How can I provide feedback?\",\"answer\":\"We really encourage all types of feedback so we can continue to improve our service.  You can leave a comment at the end of your consultation, leave a Google review or simply by contacting us via email or phone.\",\"published\":\"yes\"}', 1, '2017-11-22 16:00:54', 1),
(108, 11, 'faqs', '{\"id\":11,\"question\":\"How is MedicSpot different from other doctor apps?\",\"answer\":\"As doctors, we recognise that examination equipment is needed to safely diagnose and treat many conditions which a video-chat only doctor cannot do.  Doctors can treat you more safely and effectively if they have the ability to examine you.\",\"published\":\"yes\"}', 1, '2017-11-22 16:05:50', 1),
(112, 1, 'testimonials', '{\"id\":\"1\",\"name\":\"Jacqueline\",\"desc\":\"Excellent service - saved me hours waiting in the urgent care centre as my GP was closed.\",\"avatar_image\":\"Jacqueline.png\",\"published\":\"yes\"}', 2, '2017-11-22 16:31:39', 1),
(113, 2, 'testimonials', '{\"id\":2,\"name\":\"Kelly\",\"desc\":\"I had a great experience! The doctor was very courteous and friendly, and I was able to get a prescription filled right then and there.\",\"avatar_image\":\"kelly2.png\",\"published\":\"yes\"}', 1, '2017-11-22 16:34:33', 1),
(114, 3, 'testimonials', '{\"id\":3,\"name\":\"Trevor\",\"desc\":\"I made the appointment at 3pm and was seen at 3.30pm the same day.  Feeling much better now thanks!\",\"avatar_image\":\"trevor2.png\",\"published\":\"yes\"}', 1, '2017-11-22 17:09:36', 1),
(115, 4, 'testimonials', '{\"id\":4,\"name\":\"Michael\",\"desc\":\"Very quick, very thorough consultation on my issue.&nbsp; Very happy with outcome.\",\"avatar_image\":\"michael2.png\",\"published\":\"yes\"}', 1, '2017-11-22 17:11:13', 1),
(116, 5, 'testimonials', '{\"id\":5,\"name\":\"Nolan\",\"desc\":\"The station was so easy to use and the doctor had great bedside manner.\",\"avatar_image\":\"nolan2.png\",\"published\":\"yes\"}', 1, '2017-11-22 17:15:26', 1),
(127, 5, 'teams', '{\"id\":\"5\",\"name\":\"Jacques de Cock\",\"title\":\"\",\"bio\":\"Jacques has over 20 years experience in global consulting, technology, business creation and management. He is a founding director of Spicer and Openheim consultants and was CEO of Patsystems which he took from a 6 man start-up to a &pound;200m IPO in 3 years.\\r\\n<br>\\r\\nHe is currently CEO and partner at a business services firm, early stage advisory and a financial services consulting company. Jacques is also a trustee of 2 charities.\",\"avatar_image\":\"00d3773.jpg\",\"published\":\"yes\",\"category_id\":\"4\"}', 2, '2017-11-22 19:25:24', 1),
(128, 4, 'teams', '{\"id\":\"4\",\"name\":\"Jurek Sikorski\",\"title\":\"\",\"bio\":\"Jurek has extensive experience within the healthcare industry. After founding and exiting Boots-Celltech, Jurek became Sales & Marketing Director at Wellcome Diagnostics and Smith & Company, a FTSE 100 company. He progressed onto CEO roles at biotechnology companies before leading a medical devices start-up to successful IPO.\\r\\n<br>\\r\\nJurek is chairman of several companies and founder of Henley Business Angels.\",\"avatar_image\":\"335f7a0.jpg\",\"published\":\"yes\",\"category_id\":\"4\"}', 3, '2017-11-22 19:26:09', 1),
(129, 8, 'teams', '{\"id\":\"8\",\"name\":\"Nicholas Ibery\",\"title\":\"\",\"bio\":\"Nicholas is a co-founder and a senior advisor to MedicSpot. He is an investor with a particular interest in life sciences, focusing on social impact and sustainable investments. Nicholas holds degrees and postgraduate qualification in both medicine and law. He holds bachelors degrees in Medicine and LL.B in Law, specialising in corporate legal practice, Master&rsquo;s degree from the Imperial College and MBA from London Business School.\",\"avatar_image\":\"AAIA_wDGAAAAAQAAAAAAAAzdAAAAJGIxMDNhMjVhLTgyMjYtNGNiNS1iYTQ1LTNhMjQ2ZThiNDAxNw.jpg\",\"published\":\"yes\",\"category_id\":\"4\"}', 2, '2017-11-22 19:26:35', 1),
(130, 7, 'teams', '{\"id\":\"7\",\"name\":\"Saleem Arif\",\"title\":\"\",\"bio\":\"Saleem founded QualitySolicitors, the UK&rsquo;s first and largest legal brand with several hundred branches nationwide and now making up 5% of the entire private client legal market. Prior to founding QualitySolicitors, Saleem worked as a marketing consultant at McKinsey & Company and an equities broker at Merrill Lynch.\\r\\n\\r\\nSaleem read Economics and Cambridge and has a MBA from London Business School.\",\"avatar_image\":\"AAEAAQAAAAAAAAQMAAAAJDZiYmQyZjRlLTFmNGItNGMyZi05MGMzLTdhMWJhZDc3NWI5Mw.jpg\",\"published\":\"yes\",\"category_id\":\"4\"}', 2, '2017-11-22 19:27:10', 1),
(131, 1, 'teams', '{\"id\":\"1\",\"name\":\"Dr Zubair Ahmed\",\"title\":\"CO-FOUNDER & CEO\",\"bio\":\"Zubair read medicine at the University of Aberdeen and subsequently trained to be a GP and worked as a GP both in England and Scotland. He realised that primary healthcare provision could be made much more efficient and safer through the use of technology; which led to the launch of MedicSpot. He strongly believes that innovation has the potential to increase capacity in our health system whilst also improving the quality of care.\\r\\n<br>\\r\\nDr Ahmed is passionate about solving health challenges that we face through creativity and innovation. He holds a MBA from London Business School.\",\"avatar_image\":\"zubair2.png\",\"published\":\"yes\",\"category_id\":\"3\"}', 3, '2017-11-22 19:31:23', 1),
(132, 6, 'teams', '{\"id\":\"6\",\"name\":\"Dr Zubair Ahmed\",\"title\":\"MBChB mRCGP MBA\",\"bio\":\"Dr Ahmed has been a doctor for 10 years after obtaining his medical degree from the University of Aberdeen, Scotland. He worked across a wide array of specialities including cardiology, accident and emergency, geriatrics before focusing his energies in becoming a General Practitioner. Dr Ahmed is very excited about how technology can help both doctors and patients alike.\",\"avatar_image\":\"zubair2.png\",\"published\":\"yes\",\"category_id\":\"5\"}', 2, '2017-11-22 19:31:49', 1),
(133, 1, 'reviews', '{\"id\":\"1\",\"name\":\"Jacqueline\",\"desc\":\"excellent service - saved me hours waiting in the urgent care centre as my gp was closed.\",\"avatar_image\":\"5stars.jpg\",\"published\":\"yes\"}', 2, '2017-11-22 19:41:53', 1),
