(147, 9, 'ea_clinics', '{\"id\":\"9\",\"cl_clinic_name\":\"MedicSpot Clinic Euston\",\"cl_address_line_1\":\"62-64 Hampstead Road\",\"cl_address_line_2\":\"Euston\",\"cl_postcode\":\"NW1 2NT\",\"cl_phone_number\":\"020 3937 5666\",\"cl_email_address\":\"euston@medicspot.co.uk\",\"cl_description\":\"The Euston MedicSpot clinic is located in Greenlight Pharmacy at 62 Hampstead Road, NW1 2NT. This clinic is located in the heart of the city centre very close to the famous Euston and Kings Cross train stations. We provide a private GP service where anyone can walk-in and see a doctor instantly. The location of this clinic makes it ideal for those who work in one of the many offices nearby. If you are a tourist sightseeing in central London, this can be an easy way to see a doctor at an affordable price. You can collect your prescriptions instantly after the consultation from the pharmacy. You can book an appointment online or simply walk in and be seen quickly by one of our expert GP&rsquo;s.\",\"cl_lat\":\"51.5266968\",\"cl_lng\":\"-0.1384472\",\"cl_formatted_address\":\"62-64 Hampstead Rd, Kings Cross, London NW1 2NT, UK\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"clinics\\/england\\/london\\/camden\\/euston\\/euston-clinic\"}', 3, '2017-11-23 20:37:17', 1),
