(151, 4, 'fuel_pages', '{\"id\":\"4\",\"location\":\"how-it-works\",\"layout\":\"how_it_works\",\"published\":\"yes\",\"cache\":\"yes\",\"date_added\":\"2017-11-13 11:15:27\",\"last_modified\":\"2017-11-26 03:15:58\",\"last_modified_by\":\"1\",\"variables\":[{\"id\":\"379\",\"page_id\":\"4\",\"name\":\"body\",\"scope\":\"\",\"value\":\"Getting a GP appointment is hard enough even when you&rsquo;re feeling at your fighting best; let alone when you&rsquo;re unwell.\\r\\n\\r\\nMedicSpot is a new service which makes it simple and easy to get the care you need at a time and location suitable for you. Gone are the days of struggling to make an appointment, travelling to the surgery, late-running clinics all for a quick 10 minute appointment. MedicSpot is specifically designed to give you easy, quick and convenient access to high quality healthcare &ndash; no matter where you are or when you need it.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"how_it_works\",\"location\":\"how-it-works\",\"page_published\":\"yes\"},{\"id\":\"382\",\"page_id\":\"4\",\"name\":\"body_class\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"how_it_works\",\"location\":\"how-it-works\",\"page_published\":\"yes\"},{\"id\":\"377\",\"page_id\":\"4\",\"name\":\"heading\",\"scope\":\"\",\"value\":\"How It Works\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"how_it_works\",\"location\":\"how-it-works\",\"page_published\":\"yes\"},{\"id\":\"375\",\"page_id\":\"4\",\"name\":\"meta_description\",\"scope\":\"\",\"value\":\"Explanation of the process for seeing a GP near you on the same day. Learn more here.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"how_it_works\",\"location\":\"how-it-works\",\"page_published\":\"yes\"},{\"id\":\"376\",\"page_id\":\"4\",\"name\":\"meta_keywords\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"how_it_works\",\"location\":\"how-it-works\",\"page_published\":\"yes\"},{\"id\":\"374\",\"page_id\":\"4\",\"name\":\"page_title\",\"scope\":\"\",\"value\":\"Walk in GP Service Near Me - How it Works\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"how_it_works\",\"location\":\"how-it-works\",\"page_published\":\"yes\"},{\"id\":\"381\",\"page_id\":\"4\",\"name\":\"small_body\",\"scope\":\"\",\"value\":\"MedicSpot uses the latest advancements in medical technology to not only allow our doctors to see and speak with you, but also to perform a full clinical examination through the MedicSpot Clinical Station. As doctors, MedicSpot&rsquo;s founders recognise the importance of carrying out an appropriate clinical examination and we know to leave nothing to chance. This allows MedicSpot&rsquo;s doctors to accurately diagnose you and give you the correct treatment.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"how_it_works\",\"location\":\"how-it-works\",\"page_published\":\"yes\"},{\"id\":\"380\",\"page_id\":\"4\",\"name\":\"sub_title\",\"scope\":\"\",\"value\":\"Medicspot Clinical Station\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"how_it_works\",\"location\":\"how-it-works\",\"page_published\":\"yes\"},{\"id\":\"378\",\"page_id\":\"4\",\"name\":\"video_url\",\"scope\":\"\",\"value\":\"assets\\/video-placeholder.mp4\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"how_it_works\",\"location\":\"how-it-works\",\"page_published\":\"yes\"}]}', 6, '2017-11-26 11:15:58', 1),
