(154, 12, 'fuel_pages', '{\"id\":\"12\",\"location\":\"reviews\",\"layout\":\"reviews\",\"published\":\"yes\",\"cache\":\"yes\",\"date_added\":\"2017-11-14 03:01:35\",\"last_modified\":\"2017-11-26 03:17:46\",\"last_modified_by\":\"1\",\"variables\":[{\"id\":\"407\",\"page_id\":\"12\",\"name\":\"body\",\"scope\":\"\",\"value\":\"We are passionate about making basic healthcare more efficient, convenient & safe to everyone and we believe we do a good job at bringing this passion to life.\\r\\n<br>\\r\\nBut don&rsquo;t take our word for it. Here&rsquo;s what some of our regular customers have to say about us.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"reviews\",\"location\":\"reviews\",\"page_published\":\"yes\"},{\"id\":\"408\",\"page_id\":\"12\",\"name\":\"body_class\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"reviews\",\"location\":\"reviews\",\"page_published\":\"yes\"},{\"id\":\"406\",\"page_id\":\"12\",\"name\":\"heading\",\"scope\":\"\",\"value\":\"Reviews\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"reviews\",\"location\":\"reviews\",\"page_published\":\"yes\"},{\"id\":\"404\",\"page_id\":\"12\",\"name\":\"meta_description\",\"scope\":\"\",\"value\":\"We\'ve had some great reviews from satisfied patients of the same day walk in doctor service. Read more here.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"reviews\",\"location\":\"reviews\",\"page_published\":\"yes\"},{\"id\":\"405\",\"page_id\":\"12\",\"name\":\"meta_keywords\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"reviews\",\"location\":\"reviews\",\"page_published\":\"yes\"},{\"id\":\"403\",\"page_id\":\"12\",\"name\":\"page_title\",\"scope\":\"\",\"value\":\"Walk In Doctor Service - Reviews of our Service\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layo