(155, 11, 'fuel_pages', '{\"id\":\"11\",\"location\":\"team\",\"layout\":\"teams\",\"published\":\"yes\",\"cache\":\"yes\",\"date_added\":\"2017-11-14 02:41:39\",\"last_modified\":\"2017-11-26 03:18:41\",\"last_modified_by\":\"1\",\"variables\":[{\"id\":\"413\",\"page_id\":\"11\",\"name\":\"body\",\"scope\":\"\",\"value\":\"Our founders have all worked in the NHS and seen first hand the problems that the NHS and patients face. Through no fault of its own, the NHS is struggling to cope with rising demand from demographic shifts, more complex disease and a funding squeeze.\\r\\n<br>\\r\\nFar from trying to be a substitute for the NHS, MedicSpot hopes to complement the NHS to ensure that patients get care high quality at a time and place of their choosing. This will improve patient experience and outcomes &ndash; leading to a healthier nation.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"teams\",\"location\":\"team\",\"page_published\":\"yes\"},{\"id\":\"414\",\"page_id\":\"11\",\"name\":\"body_class\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"teams\",\"location\":\"team\",\"page_published\":\"yes\"},{\"id\":\"412\",\"page_id\":\"11\",\"name\":\"heading\",\"scope\":\"\",\"value\":\"MedicSpot is a Healthcare Company that Aims to Revolutionise the Patient Journey.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"teams\",\"location\":\"team\",\"page_published\":\"yes\"},{\"id\":\"410\",\"page_id\":\"11\",\"name\":\"meta_description\",\"scope\":\"\",\"value\":\"Find out more about the vastly experienced team behind the MedicSpot walk in GP service.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"teams\",\"location\":\"team\",\"page_published\":\"yes\"},{\"id\":\"411\",\"page_id\":\"11\",\"name\":\"meta_keywords\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"teams\",\"location\":\"team\",\"page_published\":\"yes\"},{\"id\":\"409\",\"page_id\":\"11\",\"name\":\"page_title\",\"scope\":\"\",\"value\":\"MedicSpot Same Day Doctor Service - About The Team\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"teams\",\"location\":\"team\",\"page_published\":\"yes\"}]}', 2, '2017-11-26 11:18:41', 1),
(157, 10, 'fuel_pages', '{\"id\":\"10\",\"location\":\"what-we-treat\",\"layout\":\"what_we_treat\",\"published\":\"yes\",\"cache\":\"yes\",\"date_added\":\"2017-11-14 01:53:14\",\"last_modified\":\"2017-11-26 03:19:49\",\"last_modified_by\":\"1\",\"variables\":[{\"id\":\"427\",\"page_id\":\"10\",\"name\":\"body\",\"scope\":\"\",\"value\":\"With our unique MedicSpot stations, our doctors can deal with the vast majority of your health queries that you would normally speak to your GP about. See how we&rsquo;ve helped previous patients.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"what_we_treat\",\"location\":\"what-we-treat\",\"page_published\":\"yes\"},{\"id\":\"428\",\"page_id\":\"10\",\"name\":\"body_class\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"what_we_treat\",\"location\":\"what-we-treat\",\"page_published\":\"yes\"},{\"id\":\"426\",\"page_id\":\"10\",\"name\":\"heading\",\"scope\":\"\",\"value\":\"Get the healthcare you need &ndash; when you want and where you want.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"what_we_treat\",\"location\":\"what-we-treat\",\"page_published\":\"yes\"},{\"id\":\"424\",\"page_id\":\"10\",\"name\":\"meta_description\",\"scope\":\"\",\"value\":\"Our fully qualified doctors offer a wide range of treatments available same day. Find out more here.\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"what_we_treat\",\"location\":\"what-we-treat\",\"page_published\":\"yes\"},{\"id\":\"425\",\"page_id\":\"10\",\"name\":\"meta_keywords\",\"scope\":\"\",\"value\":\"\",\"type\":\"string\",\"language\":\"english\",\"active\":\"yes\",\"layout\":\"what_we_treat\",\"location\":\"what-we-treat\",\"page_published\":\"yes\"},{\"id\":\"423\",\"page_id\":\"10\",\"name\":\"page_title\",\"scope\":\"\",\"value\":\"Walk In GP and Same Day Doctor Service - Treatments\",\"type\":\"string\",\"langu