(196, 16, 'ea_clinics', '{\"id\":\"16\",\"cl_clinic_name\":\"MedicSpot Clinic Cricklewood\",\"cl_address_line_1\":\"6 Cricklewood Broadway\",\"cl_address_line_2\":\"Cricklewood\",\"cl_postcode\":\"NW2 3HD\",\"cl_phone_number\":\"020 3937 5656\",\"cl_email_address\":\"cricklewood@medicspot.co.uk\",\"cl_description\":\"The Cricklewood MedicSpot clinic is located in Greenlight Pharmacy on 6 Cricklewood Broadway, NW2 3HD &ndash; a few doors down from the Co-op food supermarket. We offer a private doctor service where you can walk in and see one of our expert doctors or alternatively you can book an appointment online. You can pick up prescriptions straight after the consultation making the whole process quick and simple.\",\"cl_lat\":\"51.55285\",\"cl_lng\":\"-0.210386\",\"cl_formatted_address\":\"6 Cricklewood Broadway, Cricklewood, London NW2 3HD, UK\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/camden\\/cricklewood\\/cricklewood-clinic\",\"ref\":\"\",\"pharmacy_name\":\"\"}', 4, '2017-12-08 10:52:06', 1),
