cSpot GP so you can be helped.  The doctor may find it necessary to prescribe a stronger prescription only antihistamine such as fexofenadine or even prescribe a short course of steroid tablets such as prednisolone if your symptoms are particularly bad.\\r\\n\\r\\nIf despite these measures and you are still having a horrible time in controlling your hay fever; a GP can refer you to a specialist allergy doctor who can perform allergy testing and possibly prescribe a medication called Grazax.  This is a form of immunotherapy that exposes the sufferer to small amounts of pollen over a long period of time so that the body gets used to grass pollen.  However, this should be considered only as a last resort once all other avenues have been tried.\",\"main_image\":\"Hay_Fever.jpg\",\"date_added\":\"2017-12-08 05:47:06\",\"published\":\"yes\",\"summary\":\"It is estimated that hay fever affected approximately 13 million people in the UK last year. Hay fever is one of those illnesses that can cause sufferers no end of discomfort and inconvenience, especially during the summer months. The good news is that, working alongside a general practitioner, there are now numerous ways of treating this condition, and MedicSpot can help put you on the path to easing those symptoms.\"}', 6, '2017-12-09 09:16:41', 1),
(228, 4, 'articles', '{\"id\":4,\"title\":\"What\'s a UTI?\",\"slug\":\"whats-a-uti\",\"author_id\":\"\",\"content\":\"A urinary tract infection (UTI) can carry a range of symptoms depending on where the infection is based within the urinary tract. UTIs can be particularly painful and, due to the potential for some to turn serious, in most cases you will be required to receive diagnosis and treatment by a qualified doctor.\\r\\n\\r\\n<h1>What are Urinary Tract Infections (UTIs)?<\\/h1>\\r\\n\\r\\nIn adults, UTIs are most common in women with some suffering from frequent urinary tract infections. While they are painful and can be incredibly uncomfortable, they can also pass in just a few days.  Others are more serious and can lead to further complications, which is why it&rsquo;s important to seek professional medical help should you suspect you have a UTI.\\r\\n\\r\\nIn children, UTIs are also fairly common but are very rarely serious. That said, swift diagnosis and treatment should be sought if you suspect your child has a urinary tract infection.\\r\\n\\r\\nEssentially, UTIs can be broken down in to two types.  A lower UTI and an upper UTI.  A lower urinary tract infection is an infection of the bladder (cystitis) or the tube that carries urine out of the body, known as the urethra. An upper urinary tract infection is an infection of the kidneys or the ureter, the tube that carries urine from the kidneys to the bladder.\\r\\n\\r\\nOf the two, an upper UTI is most likely to become more serious if left untreated. Serious cases can damage the kidneys permanently or the infection can spread to the bloodstream, both of which can be a huge problem. This the reasons why swift diagnosis and treatment from a doctor is of paramount importance.  Thankfully, upper UTI&rsquo;s are much less common.\\r\\n\\r\\nA UTI is generally caused when bacteria infect your urinary tract. The most common way that this happens is when bacteria from the gut enters the urinary tract via the urethra. This can occur for many reasons, including by wiping your bottom or having sex, but often there is no clear way of knowing how the bacteria that caused the urinary tract infection came to be in the urinary tract.\\r\\n\\r\\n<h1>Symptoms of a Urinary Tract Infection (UTI)<\\/h1>\\r\\n\\r\\nThe symptoms of a Urinary Tract Infection will generally vary depending on which type of UTI it is.  Symptoms of each type are as follows:\\r\\n\\r\\n<h3>Lower Urinary Tract Infection<\\/h3>\\r\\n\\r\\n- Pain low down in your stomach area\\r\\n- Needing to urinate more often than usual\\r\\n- A sudden urge to urinate\\r\\n- Discoloured, cloudy and possible bloody urine\\r\\n- Foul-smelling urine\\r\\n- Discomfort or even pain when urinating\\r\\n- A general feeling of being unwell\\r\\n- Fatigue\\r\\n- Aches\\r\\n- Still feeling the need to urinate after doing so\\r\\n\\r\\n<h3>Upper Urinary Tract Infection<\\/h3>\\r\\n\\r\\nSymptoms of the more serious upper urinary tract infection are often less easy for the sufferer to pinpoint as being related to the urinary tract.  They include:\\r\\n\\r\\n- Having a high temperature, or fever, of 38C (100.4&ordm;F) or higher\\r\\n- Having pain in your side or back\\r\\n- Shivering and chills\\r\\n- Feeling nauseous\\r\\n- Being sick\\r\\n- Finding yourself confused\\r\\n- Restlessness\\r\\n- Agitation\\r\\n \\r\\n\\r\\n<h1>Diagnosis of a Urinary Tract Infection\\r\\n<\\/h1>\\r\\nIf you suspect you may have a urinary tract infection, it&rsquo;s best to make an appointment to see a doctor immediately.  If you are unable to see your own GP then MedicSpot can help give you convenient and quick access a GP who can confirm you have a UTI and offer you the appropriate treatment. A sample of urine may be needed to help the doctor diagnose a UTI, but in most cases this is not needed &ndash; especially if you are female.\\r\\n\\r\\nIf you decide not to seek medical advice immediately, then you should certainly do so if your condition worsens or does not improve after a few days.  It&rsquo;s important that if your symptoms are consistent with an upper urinary tract infection that you seek an appointment with a doctor as soon as possible as many times upper UTI&rsquo;s need careful monitoring in a hospital.\\r\\n\\r\\n<h1>Treatment of a Urinary Tract Infection<\\/h1>\\r\\n\\r\\nAS UTI&rsquo;s are caused by bacteria, the common treatment for a Urinary Tract Infection is a short course of antibiotics. Males, pregnant women and the elderly may need a longer course of antibiotics which your doctor can advise you about.  Antibiotics such can be cleared up quickly to minimise the risk of infection spreading.\\r\\n\\r\\nOrdinarily, the symptoms of a urinary tract infection will pass within a matter of days from starting treatment with antibiotics. This can be as few as 3-5 days, but even if you are feeling better it is important that you complete the full course of medication prescribed to you to ensure that the infection is fully cleared up and the risk of antibiotic resistance is minimised.\\r\\n\\r\\nWhile antibiotics are the only medication that will treat the bacterial infection, there are other things that you can do to help relieve the symptoms.  Paracetamol or Ibuprofen can help ease the potential pain and fever caused by the UTI and while keeping yourself hydrated by drinking a lot of water will also help in flushing the infection out.\\r\\n\\r\\nIf your symptoms do not clear up within a week of starting a course of medication from your doctor, it may be that the type of bacterial infection you have does not respond to the antibiotics. The infection may have spread further than initially thought, or it could have led to complications elsewhere such as in the kidneys.\\r\\n\\r\\nThere is currently very little evidence that suggests cranberry juice\\/capsules or the regular taking of probiotics can help prevent UTIs. If you suffer from urine infections regularly, speak to your GP about other potential treatments of ways in which you may be able to prevent them from occurring.\",\"main_image\":\"UTI-e1500883620253.jpg\",\"date_added\":\"2017-12-09 01:31:13\",\"published\":\"yes\",\"summary\":\"It&rsquo;s estimated half of all women in the UK will have a UTI at least once in their life, and 1 in 2,000 healthy men will develop one each year.  Therefore we felt it was necessary to help you understand what are UTIs, how can you detect it and what can you do about it if you have been diagnosed.\"}', 1, '2017-12-09 09:31:13', 1),
