(263, 53, 'ea_clinics', '{\"id\":\"53\",\"cl_clinic_name\":\"MedicSpot Clinic Nottingham\",\"cl_address_line_1\":\"194 Alfreton Road\",\"cl_address_line_2\":\"Nottingham\",\"cl_postcode\":\"NG7 3PE\",\"cl_phone_number\":\"0115 896 7754\",\"cl_email_address\":\"nottingham@medicspot.co.uk\",\"cl_description\":\"The Nottingham MedicSpot clinic is conveniently located inside Midnight Pharmacy on Alfreton Road, just north of the city centre. Book today if you need same day access to a GP.\",\"cl_lat\":\"52.9606923\",\"cl_lng\":\"-1.1691743\",\"cl_formatted_address\":\"194 Alfreton Rd, Nottingham NG7 3PE, UK\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/nottinghamshire\\/nottingham\\/nottingham-clinic\",\"ref\":\"MSPOT37\",\"pharmacy_name\":\"Midnight Pharmacy Nottingham\"}', 1, '2017-12-10 11:04:07', 1),
(264, 25, 'ea_clinics', '{\"id\":\"25\",\"cl_clinic_name\":\"MedicSpot Clinic Paddington\",\"cl_address_line_1\":\"107 Praed Street\",\"cl_address_line_2\":\"\",\"cl_postcode\":\"W2 1NT\",\"cl_phone_number\":\"020 3937 9936\",\"cl_email_address\":\"paddington@medicspot.co.uk\",\"cl_description\":\"This MedicSpot clinic is located in Apek Pharmacy on 107 Praed Street, W2 1NT &ndash; directly opposite the main entrance of St. Marys Hospital. You can easily get here from Edgware Road and Paddington Underground Stations which are both minutes walk. If you are tired of waiting for weeks for an appointment with your usual GP then this is perfect for you as you just have to turn up at a time that suits and see one of our expert GPs instantly. No pre-booking required!\",\"cl_lat\":\"51.5172603\",\"cl_lng\":\"-0.1723911\",\"cl_formatted_address\":\"107 Praed Street, Paddington, London W2 1NT, United Kingdom\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/westminster\\/paddington\\/paddington-clinic\",\"ref\":\"MSPOT10\",\"pharmacy_name\":\"Apek Pharmacy\"}', 2, '2017-12-10 11:05:38', 1),
(265, 41, 'ea_clinics', '{\"id\":\"41\",\"cl_clinic_name\":\"MedicSpot Clinic Pimlico\",\"cl_address_line_1\":\"34-36 Warwick Way\",\"cl_address_line_2\":\"Pimlico\",\"cl_postcode\":\"SW1V 1RY\",\"cl_phone_number\":\"020 3946 3690\",\"cl_email_address\":\"pimlico@medicspot.co.uk\",\"cl_description\":\"This is located in Warwick Pharmacy at 34-36 Warwick Way, W11 1HG. This MedicSpot clinic lies in the heart of the city with London Victoria Station and Buckingham Palace very nearby. This would be very convenient for tourists, commuters and people working within the area that wish to be seen by a doctor for their GP needs. Due to the quick nature of this MedicSpot clinic, you do not need to plan your day around it and can simply just pop in and be seen instantly by GP at your time of choosing during our opening hours. Prescriptions can be collected quickly after the consultation.\",\"cl_lat\":\"51.491989\",\"cl_lng\":\"-0.140335\",\"cl_formatted_address\":\"34-36 Warwick Way, Pimlico, London SW1V 1RY, UK\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/westminster\\/pimlico\\/pimlico-clinic\",\"ref\":\"MSPOT25\",\"pharmacy_name\":\"WarwicK Pharmacy\"}', 1, '2017-12-10 11:06:33', 1),
(267, 40, 'ea_clinics', '{\"id\":\"40\",\"cl_clinic_name\":\"MedicSpot Clinic Primrose Hill\",\"cl_address_line_1\":\"28 England\'s Lane\",\"cl_address_line_2\":\"Primrose Hill\",\"cl_postcode\":\"NW3 4UE\",\"cl_phone_number\":\"020 3946 3688\",\"cl_email_address\":\"primrosehill@medicspot.co.uk\",\"cl_description\":\"This MedicSpot clinic is found in Allchin Pharmacy at 28 England&rsquo;s Lane, NW3 4UE1 &ndash; on the corner with Primrose Gardens. Chalk Farm is the closest underground station with Belsize Park and Swiss Cottage underground stations also being very close. We offer a private GP service where anyone can walk in and instantly be seen by one of our doctors. This clinic is convenient for those who work and live in the area or those visiting London Zoo which is a twenty-minute walk. Booking an appointment online is recommended, but not necessary.\",\"cl_lat\":\"51.5461186\",\"cl_lng\":\"-0.1620878\",\"cl_formatted_address\":\"28 England\'s Ln, Primrose Hill, London NW3 4UE, UK\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/camden\\/primrose-hill\\/primrose-hill-clinic\",\"ref\":\"MSPOT24\",\"pharmacy_name\":\"Allchin Pharmacy\"}', 1, '2017-12-10 11:54:17', 1),
(268, 52, 'ea_clinics', '{\"id\":\"52\",\"cl_clinic_name\":\"MedicSpot Clinic Roundhay\",\"cl_address_line_1\":\"168 Roundhay Road\",\"cl_address_line_2\":\"Roundhay\",\"cl_postcode\":\"LS8 5PL\",\"cl_phone_number\":\"0113 468 7249\",\"cl_email_address\":\"roundhay@medicspot.co.uk\",\"cl_description\":\"The Leeds Roundhay MedicSpot Clinic is located on the corner of Roundhay Road and Elford Grove, inside Khan&rsquo;s Pharmacy. This is conveniently situated for all of Leed&rsquo;s residents. Just book online to see one of our online doctors at a time convenient for you.\",\"cl_lat\":\"53.8122103\",\"cl_lng\":\"-1.5216806\",\"cl_formatted_address\":\"168 Roundhay Road, Leeds LS8 5PL, UK\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/west-yorkshire\\/leeds\\/roundhay-clinic\",\"ref\":\"MSPOT36\",\"pharmacy_name\":\"Khan Pharmacy Leeds\"}', 1, '2017-12-10 11:55:15', 1),
(269, 54, 'ea_clinics', '{\"id\":\"54\",\"cl_clinic_name\":\"MedicSpot Clinic Shearbridge\",\"cl_address_line_1\":\"354 Great Horton Road\",\"cl_address_line_2\":\"Bradford\",\"cl_postcode\":\"BD7 1QJ\",\"cl_phone_number\":\"01274 299185\",\"cl_email_address\":\"shearbridge@medicspot.co.uk\",\"cl_description\":\"Your Bradford MedicSpot clinic is located inside Midnight Pharmacy on 354 Great Horton Road. If you need quick and affordable access to a private GP, either just turn up or book online.\",\"cl_lat\":\"53.7870434\",\"cl_lng\":\"-1.7741697\",\"cl_formatted_address\":\"354 Great Horton Rd, Bradford BD7 1QJ, UK\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/west-yorkshire\\/bradford\\/bradford-clinic\",\"ref\":\"MSPOT38\",\"pharmacy_name\":\"Midnight Pharmacy Bradford\"}', 1, '2017-12-10 11:58:17', 1),
(271, 35, 'ea_clinics', '{\"id\":\"35\",\"cl_clinic_name\":\"MedicSpot Clinic South Kensington\",\"cl_address_line_1\":\"35-37 Old Brompton Road\",\"cl_address_line_2\":\"Kensington\",\"cl_postcode\":\"SW7 3HZ\",\"cl_phone_number\":\"020 3946 3669\",\"cl_email_address\":\"southkensington@medicspot.co.uk\",\"cl_description\":\"Your South Kensington MedicSpot Clinic is located in the consultation suite at Harley&rsquo;s Chemist on 35-37 Old Brompton Road, SW7 3HZ &ndash; just a stone throw away from South Kensington Underground Station. It&rsquo;s better to book your appointment online before you go, but you can also simply walk in without a booking to see one of our expert doctors. If you live or work in South Kensington then using MedicSpot for your GP health needs will be ideal for you. There is sufficient room for wheelchair access and we are happy to provide additional assistance to our patients.\",\"cl_lat\":\"51.493434\",\"cl_lng\":\"-0.175115\",\"cl_formatted_address\":\"35-37 Old Brompton Rd, Kensington, London SW7 3HZ, UK\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/kensington-chelsea\\/kensington\\/south-kensington-clinic\",\"ref\":\"MSPOT19\",\"pharmacy_name\":\"Harleys Pharmacy\"}', 1, '2017-12-10 12:02:35', 1),
(272, 31, 'ea_clinics', '{\"id\":\"31\",\"cl_clinic_name\":\"MedicSpot Clinic South Kensington Station\",\"cl_address_line_1\":\"6 South Kensington Station Arcade\",\"cl_address_line_2\":\"Kensington\",\"cl_postcode\":\"SW7 2NA\",\"cl_phone_number\":\"020 3946 3663\",\"cl_email_address\":\"southkensingtonstation@medicspot.co.uk\",\"cl_description\":\"This Kensington MediSpot clinic is conveniently located inside South Kensington Underground Station. The location of this clinic makes it ideal for those who use the station to commute or residents who do not want to wait long for an appointment with their normal doctor. You can simply book an appointment online using our quick booking system or just walk in and ask to see a doctor. Prescriptions can be picked up directly from the pharmacy after the consultation making for a fast and easy process.\",\"cl_lat\":\"51.4941275\",\"cl_lng\":\"-0.1740792\",\"cl_formatted_address\":\"6 S Kensington Station Arcade, Kensington, London SW7 2NA, UK\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/kensington-chelsea\\/kensington\\/south-kensington-station-clinic\",\"ref\":\"MSPOT16\",\"pharmacy_name\":\"Sticklands Pharmacy\"}', 1, '2017-12-10 12:03:54', 1);
