(281, 22, 'ea_clinics', '{\"id\":\"22\",\"cl_clinic_name\":\"MedicSpot Clinic Southwark\",\"cl_address_line_1\":\"9 Upper Ground\",\"cl_address_line_2\":\"Southwark\",\"cl_postcode\":\"SE1 9LP\",\"cl_phone_number\":\"020 3937 9884\",\"cl_email_address\":\"southwark@medicspot.co.uk\",\"cl_description\":\"Just minutes walk from Blackfriars Bridge, our flagship Southwark clinic is located conveniently for thousands of residents, tourists and commuters in and around Waterloo, Southwark and Blackfriars. This MedicSpot clinic is located inside Kalmak Chemist, 9 Upper Ground, SE1 9LP. Should you wish to seek medical attention, it&rsquo;s recommended you book an appointment online. However, if you are unable to do this then simply turn up to our MedicSpot clinic from where you will see one of our expert GP&rsquo;s in a matter of minutes. Save time and all the hassle in seeing your regular GP.\",\"cl_lat\":\"51.508147\",\"cl_lng\":\"-0.1057661\",\"cl_formatted_address\":\"9 Upper Ground, Southwark, London SE1 9LP, United Kingdom\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/southwark\\/southwark\\/southwark-clinic\",\"ref\":\"\",\"pharmacy_name\":\"\"}', 2, '2017-12-10 14:14:34', 1),
