 of international students that will head to the United Kingdom to begin studies at university in the coming months, knowing how to register with an NHS GP will be really important.\\r\\n\\r\\nThere is so much to sort out when you decide to study abroad, from enrolling on your course and meeting new people, to finding student housing and possibly even a part-time job. It\'s little surprise that registering with the NHS is one of the last things on your mind so we\'ve compiled a handy guide to get you started.\",\"meta_keywords\":\"asdasd\",\"meta_description\":\"asdasdas\"}', 12, '2017-12-11 12:06:44', 1),
