(315, 28, 'ea_clinics', '{\"id\":\"28\",\"cl_clinic_name\":\"MedicSpot Clinic Glasgow Centre\",\"cl_address_line_1\":\"128 High Street\",\"cl_address_line_2\":\"Glasgow\",\"cl_postcode\":\"G1 1PQ\",\"cl_phone_number\":\"0141 406 5808\",\"cl_email_address\":\"glasgowcentre@medicspot.co.uk\",\"cl_description\":\"The Glasgow City Centre MedicSpot Clinic is located at 128 High Street, G1 1PQ inside Glasgow High Street Pharmacy &ndash; just at the end of Ingram Street next door to Aldi. We offer convenient and affordable private GP consultations with prescriptions to patients in surrounding areas such as Paisley and Clydebank in addition to Glasgow. You can either pre-book or you can choose to turn up and see the doctor at a time whenever it suits. There is good wheelchair access at this clinic.\",\"cl_lat\":\"55.859139\",\"cl_lng\":\"-4.240898\",\"cl_formatted_address\":\"128 High St, Glasgow G1 1PQ, UK\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"scotland\\/glasgow\\/glasgow\\/glasgow-centre-clinic\",\"ref\":\"MSPOT13\",\"pharmacy_name\":\"High Street Pharmacy Glasgow\",\"alias_url\":\"scotland\\/glasgow\\/glasgow-centre\\/glasgow-centre-clinic\"}', 3, '2017-12-12 05:27:26', 1),
(317, 18, 'ea_clinics', '{\"id\":\"18\",\"cl_clinic_name\":\"MedicSpot Clinic Shepherds Bush\",\"cl_address_line_1\":\"228-230 Uxbridge Road\",\"cl_address_line_2\":\"London\",\"cl_postcode\":\"W12 7JD\",\"cl_phone_number\":\"020 3937 7710\",\"cl_email_address\":\"shepherdsbush@medicspot.co.uk\",\"cl_description\":\"This MedicSpot clinic is located in the consulting room of GreenLight Pharmacy on 228 Uxbridge Road, Shepherd&rsquo;s Bush, W12 7DJ &ndash; very close to Westfield Shopping Centre. Our doctors have already helped many patients who live, work or shop in the area and are looking forward to helping many more. It&rsquo;s preferable if you use our quick online booking system to book before you come, but if you&rsquo;re in the area already and feel unwell &ndash; simply just walk in and be on the road to recovery after seeing one of our doctors. If you are prescribed medicine, this can be collected from pharmacy straight after the consultation.\",\"cl_lat\":\"51.5058975\",\"cl_lng\":\"-0.2277367\",\"cl_formatted_address\":\"228-230 Uxbridge Road, Shepherds Bush, London W12 7JD, United Kingdom\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/hammersmith-fulham\\/shepherds-bush\\/shepherds-bush-clinic\",\"ref\":\"MSPOT3\",\"pharmacy_name\":\"Greenlight Shepherds Bush\",\"alias_url\":\"england\\/london\\/hammersmith-fulham\\/shepherds-bush\"}', 4, '2017-12-12 05:35:50', 1),
