(321, 48, 'ea_clinics', '{\"id\":\"48\",\"cl_clinic_name\":\"MedicSpot Clinic Cambridge\",\"cl_address_line_1\":\"28-30 Trumpington Street\",\"cl_address_line_2\":\"Cambridge\",\"cl_postcode\":\"CB2 1QZ\",\"cl_phone_number\":\"01223 800935\",\"cl_email_address\":\"cambridge@medicspot.co.uk\",\"cl_description\":\"The Cambridge MedicSpot clinic is situated inside the Fitzwilliam Pharmacy at 28-30 Trumpington Road, CB2 1QZ &ndash; on a corner with Fitzwilliam Street. It is located directly opposite the Fitzwilliam Museum and close to many of the university campuses making it ideal for students who are reluctant to wait for appointments with their regular GP. If you live, work or study in the city and want to be seen by a GP then come to our MedicSpot clinic where you will be seen by one of our expert doctors within minutes. Prescriptions can be picked up directly after your consultation allowing for a fast service. No booking required, although recommended.\",\"cl_lat\":\"52.200338\",\"cl_lng\":\"0.120241\",\"cl_formatted_address\":\"28-30 Trumpington St, Cambridge CB2 1QZ, UK\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/cambridgeshire\\/cambridge\\/cambridge-clinic\",\"ref\":\"MSPOT32\",\"pharmacy_name\":\"Fitzwilliam Pharmacy\",\"alias_url\":\"england\\/cambridgeshire\\/cambridge\\/cambridge-clinic\\/medicspot-clinic-cambridge\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 4, '2017-12-12 05:59:12', 1),
(322, 27, 'ea_clinics', '{\"id\":\"27\",\"cl_clinic_name\":\"MedicSpot Clinic Holborn\",\"cl_address_line_1\":\"41 Bloomsbury Way\",\"cl_address_line_2\":\"\",\"cl_postcode\":\"WC1A 2SA\",\"cl_phone_number\":\"020 3946 3555\",\"cl_email_address\":\"holborn@medicspot.co.uk\",\"cl_description\":\"Should you wish to seek medical attention, then come and visit our MedicSpot clinic in Kerrs Chemist on 41 Bloomsbury Way, WC1A 2SA where you can be seen by a GP within minutes. Our clinic is only minutes away from Holborn Underground Station and Tottenham Court Road Underground Station. Booking an appointment is recommended but you can easily just walk in and be seen by one of our skillful GPs for an affordable price.\",\"cl_lat\":\"51.5173313\",\"cl_lng\":\"-0.1248945\",\"cl_formatted_address\":\"41 Bloomsbury Way, Holborn, London WC1A 2SA, UK\",\"1_image\":\"\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/camden\\/holborn\\/holborn-clinic\",\"ref\":\"MSPOT12\",\"pharmacy_name\":\"Kerrs Chemist\",\"alias_url\":\"england\\/london\\/camden\\/holborn\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 2, '2017-12-12 06:03:46', 1),
(326, 43, 'ea_clinics', '{\"id\":\"43\",\"cl_clinic_name\":\"MedicSpot Clinic Battersea\",\"cl_address_line_1\":\"15 Battersea Rise\",\"cl_address_line_2\":\"Battersea\",\"cl_postcode\":\"SW11 1HG\",\"cl_phone_number\":\"020 3946 3694\",\"cl_email_address\":\"battersea@medicspot.co.uk\",\"cl_description\":\"Our Clapham clinic is located at Robards Pharmacy at 15 Battersea Rise, SW11 1HG. MedicSpot will provide you with an instant consultation with one of our expert GPs for an affordable price. It is very close to Clapham Junction Station, Clapham underground stations and the shopping centre. Our highly trained doctors have helped many patients who live, work or shop nearby and look forward to treating more. If you wish to see a GP for an affordable price, the come visit us for an instant consultation where you can puck up your prescription on your way out. No booking required!\",\"cl_lat\":\"51.460847\",\"cl_lng\":\"-0.163174\",\"cl_formatted_address\":\"15 Battersea Rise, Battersea, London SW11 1HG, UK\",\"1_image\":\"MedicSpot_Clinic_Battersea_Consulting_Room.JPG\",\"2_image\":\"\",\"3_image\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/wandsworth\\/battersea\\/battersea-clinic\",\"ref\":\"MSPOT27\",\"pharmacy_name\":\"Robards Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 2, '2017-12-15 06:35:39', 1),
