(328, 45, 'ea_clinics', '{\"id\":\"45\",\"cl_clinic_name\":\"MedicSpot Clinic Berkhamsted\",\"cl_address_line_1\":\"224 High Street\",\"cl_address_line_2\":\"Berkhamsted\",\"cl_postcode\":\"HP4 1BB\",\"cl_phone_number\":\"01442 506375\",\"cl_email_address\":\"berkhamsted@medicspot.co.uk\",\"cl_description\":\"Our Berkhamsted MedicSpot clinic is located within H.H Dickman Pharmacy at 224 High Street &ndash; directly opposite Natwest bank. It is conveniently located a five minute walk from Berkhamsted Station making this clinic ideal for those who use the station to commute to work. MedicSpot have also been treating patients that live and work in the area who want to see a GP instantly. Prescriptions can be picked up from the pharmacy on the way out making it a quick and easy experience.\",\"cl_lat\":\"51.761082\",\"cl_lng\":\"-0.566014\",\"cl_formatted_address\":\"224 High St, Berkhamsted HP4 1BB, UK\",\"1_image\":\"MedicSpot_Clinic_Berkhamsted_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Berkhamsted_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Berkhamsted_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/hertfordshire\\/berkhamsted\\/berkhamsted-clinic\",\"ref\":\"MSPOT29\",\"pharmacy_name\":\"Dickman HH & Son Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 2, '2017-12-15 06:41:10', 1),
(329, 50, 'ea_clinics', '{\"id\":\"50\",\"cl_clinic_name\":\"MedicSpot Clinic Bristol\",\"cl_address_line_1\":\"192 Stapleton Road\",\"cl_address_line_2\":\"Bristol\",\"cl_postcode\":\"BS5 0NY\",\"cl_phone_number\":\"0117 440 0799\",\"cl_email_address\":\"bristol@medicspot.co.uk\",\"cl_description\":\"Your Bristol MedicSpot clinic is situated inside Easton Day & Night Chemist on 192 Stapleton Road, BS5 0NY &ndash; located on the corner opposite Subway. We provide a high-quality private GP service where you can be seen and pick up your prescription instantly. This MedicSpot clinic is an affordable and easy way to see a skilled GP without the waits you would get at your normal clinic. Simply just come in and ask to see a doctor &ndash; it will only take minutes.\",\"cl_lat\":\"51.464049\",\"cl_lng\":\"-2.570454\",\"cl_formatted_address\":\"192 Stapleton Rd, Bristol BS5 0NY, UK\",\"1_image\":\"MedicSpot_Clinic_Bristol_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Bristol_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Bristol_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/bristol\\/bristol\\/bristol-clinic\",\"ref\":\"MSPOT34\",\"pharmacy_name\":\"Easton Day and Night Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 3, '2017-12-15 06:43:31', 1),
