(348, 38, 'ea_clinics', '{\"id\":\"38\",\"cl_clinic_name\":\"MedicSpot Clinic Elephant & Castle\",\"cl_address_line_1\":\"46 St George\'s Road\",\"cl_address_line_2\":\"Newington\",\"cl_postcode\":\"SE1 6ET\",\"cl_phone_number\":\"020 3946 3684\",\"cl_email_address\":\"elephantandcastle@medicspot.co.uk\",\"cl_description\":\"This MedicSpot clinic is located in St. George&rsquo;s Pharmacy at 46 St George&rsquo;s Road, SE1 6ET &ndash; less than five-minute walk from Elephant & Castle Shopping Centre and across the road from Elephant & Castle underground station. This location is convenient for people shopping, living or working in the area. MedicSpot provides a quick and affordable private GP service where anyone can walk in and been seen by one of our expert GPs. If you are prescribed medicine, your prescription can be collected from pharmacy straight after the consultation.\",\"cl_lat\":\"51.4957\",\"cl_lng\":\"-0.101953\",\"cl_formatted_address\":\"46 St George\'s Rd, Newington, London SE1 6ET, UK\",\"1_image\":\"MedicSpot_Clinic_Elephant_and_Castle_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Elephant_and_Castle_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Elephant_and_Castle_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/southwark\\/newington\\/elephant-castle-clinic\",\"ref\":\"MSPOT22\",\"pharmacy_name\":\"St Georges Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 2, '2017-12-15 07:30:32', 1),
(349, 32, 'ea_clinics', '{\"id\":\"32\",\"cl_clinic_name\":\"MedicSpot Clinic Isleworth\",\"cl_address_line_1\":\"1 Shrewsbury Walk\",\"cl_address_line_2\":\"\",\"cl_postcode\":\"TW7 7DE\",\"cl_phone_number\":\"020 3917 6896\",\"cl_email_address\":\"isleworth@medicspot.co.uk\",\"cl_description\":\"Our MedicSpot Clinic Isleworth is located inside Riverside Pharmacy which is an extended hour pharmacy - open until 22.30 each day.  It\'s located in the Woodlands area near West Middlesex Hospital on the junction of South Street and Shrewsbury Walk.  If you need a quick GP appointment, then simply book online and then go to the pharmacy to be instantly connected to one of our expert doctors.\",\"cl_lat\":\"51.4682881\",\"cl_lng\":\"-0.325005\",\"cl_formatted_address\":\"1 Shrewsbury Walk, Isleworth TW7 7DE, UK\",\"1_image\":\"MedicSpot_Clinic_Isleworth_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Isleworth_GP_Surgery_Outside.jpg\",\"3_image\":\"MedicSpot_Clinic_Isleworth_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/hounslow\\/isleworth\\/isleworth-clinic\",\"ref\":\"\",\"pharmacy_name\":\"\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 5, '2017-12-15 07:33:41', 1),
(350, 17, 'ea_clinics', '{\"id\":\"17\",\"cl_clinic_name\":\"MedicSpot Clinic Euston\",\"cl_address_line_1\":\"62-64 Hampstead Road\",\"cl_address_line_2\":\"Euston\",\"cl_postcode\":\"NW1 2NT\",\"cl_phone_number\":\"020 3937 5666\",\"cl_email_address\":\"euston@medicspot.co.uk\",\"cl_description\":\"The Euston MedicSpot clinic is located in Greenlight Pharmacy at 62 Hampstead Road, NW1 2NT. This clinic is located in the heart of the city centre very close to the famous Euston and Kings Cross train stations. We provide a private GP service where anyone can walk-in and see a doctor instantly. The location of this clinic makes it ideal for those who work in one of the many offices nearby. If you are a tourist sightseeing in central London, this can be an easy way to see a doctor at an affordable price. You can collect your prescriptions instantly after the consultation from the pharmacy. You can book an appointment online or simply walk in and be seen quickly by one of our expert GP&rsquo;s.\",\"cl_lat\":\"51.5266968\",\"cl_lng\":\"-0.1384472\",\"cl_formatted_address\":\"62-64 Hampstead Rd, Kings Cross, London NW1 2NT, UK\",\"1_image\":\"MedicSpot_Clinic_Euston_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Euston_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Euston_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/camden\\/euston\\/euston-clinic\",\"ref\":\"MSPOT2\",\"pharmacy_name\":\"Greenlight Pharmacy Euston\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 2, '2017-12-15 07:34:43', 1),
(351, 28, 'ea_clinics', '{\"id\":\"28\",\"cl_clinic_name\":\"MedicSpot Clinic Glasgow Centre\",\"cl_address_line_1\":\"128 High Street\",\"cl_address_line_2\":\"Glasgow\",\"cl_postcode\":\"G1 1PQ\",\"cl_phone_number\":\"0141 406 5808\",\"cl_email_address\":\"glasgowcentre@medicspot.co.uk\",\"cl_description\":\"The Glasgow City Centre MedicSpot Clinic is located at 128 High Street, G1 1PQ inside Glasgow High Street Pharmacy &ndash; just at the end of Ingram Street next door to Aldi. We offer convenient and affordable private GP consultations with prescriptions to patients in surrounding areas such as Paisley and Clydebank in addition to Glasgow. You can either pre-book or you can choose to turn up and see the doctor at a time whenever it suits. There is good wheelchair access at this clinic.\",\"cl_lat\":\"55.859139\",\"cl_lng\":\"-4.240898\",\"cl_formatted_address\":\"128 High St, Glasgow G1 1PQ, UK\",\"1_image\":\"MedicSpot_Clinic_Glasgow_Centre_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Glasgow_Centre_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Glasgow_Centre_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"scotland\\/glasgow\\/glasgow\\/glasgow-centre-clinic\",\"ref\":\"MSPOT13\",\"pharmacy_name\":\"High Street Pharmacy Glasgow\",\"alias_url\":\"scotland\\/glasgow\\/glasgow-centre\\/glasgow-centre-clinic\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 4, '2017-12-15 07:36:23', 1),
