(359, 20, 'ea_clinics', '{\"id\":\"20\",\"cl_clinic_name\":\"MedicSpot Clinic London Bridge\",\"cl_address_line_1\":\"39-41 Borough High Street\",\"cl_address_line_2\":\"\",\"cl_postcode\":\"SE1 1LZ\",\"cl_phone_number\":\"020 3937 9880\",\"cl_email_address\":\"londonbridge@medicspot.co.uk\",\"cl_description\":\"Our London Bridge MedicSpot clinic is located in City Pharmacy&ndash; 39-41 Borough High Street, SE1 1LZ. It is only a few minutes walk from both London Bridge train and underground station just south of the Thames. We provide a high-quality private GP service where you can be seen by a doctor and pick up your prescription instantly. This MedicSpot clinic is an affordable and convenient way to see a MedicSpot GP at a time of your choosing. MedicSpot has helped many of the thousands of patients that work nearby in offices and the Shard as well as visitors and tourists to the UK.\",\"cl_lat\":\"51.5049803\",\"cl_lng\":\"-0.0896982\",\"cl_formatted_address\":\"39-41 Borough High Street, London Bridge, London SE1 1LZ, United Kingdom\",\"1_image\":\"MedicSpot_Clinic_London_Bridge_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_London_Bridge_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_London_Bridge_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/southwark\\/london-bridge\\/london-bridge-clinic\",\"ref\":\"MSPOT5\",\"pharmacy_name\":\"City Pharmacy London Bridge\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 3, '2017-12-15 07:59:05', 1),
(360, 54, 'ea_clinics', '{\"id\":\"54\",\"cl_clinic_name\":\"MedicSpot Clinic Shearbridge\",\"cl_address_line_1\":\"354 Great Horton Road\",\"cl_address_line_2\":\"Bradford\",\"cl_postcode\":\"BD7 1QJ\",\"cl_phone_number\":\"01274 299185\",\"cl_email_address\":\"shearbridge@medicspot.co.uk\",\"cl_description\":\"Your Bradford MedicSpot clinic is located inside Midnight Pharmacy on 354 Great Horton Road. If you need quick and affordable access to a private GP, either just turn up or book online.\",\"cl_lat\":\"53.7870434\",\"cl_lng\":\"-1.7741697\",\"cl_formatted_address\":\"354 Great Horton Rd, Bradford BD7 1QJ, UK\",\"1_image\":\"MedicSpot_Clinic_Shearbridge_Consulting_Room.jpg\",\"2_image\":\"MedicSpot_Clinic_Shearbridge_GP_Surgery_Outside.jpg\",\"3_image\":\"MedicSpot_Clinic_Shearbridge_Virtual_Consultation.jpg\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/west-yorkshire\\/bradford\\/bradford-clinic\",\"ref\":\"MSPOT38\",\"pharmacy_name\":\"Midnight Pharmacy Bradford\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 2, '2017-12-15 07:59:54', 1),
