(362, 35, 'ea_clinics', '{\"id\":\"35\",\"cl_clinic_name\":\"MedicSpot Clinic South Kensington\",\"cl_address_line_1\":\"35-37 Old Brompton Road\",\"cl_address_line_2\":\"Kensington\",\"cl_postcode\":\"SW7 3HZ\",\"cl_phone_number\":\"020 3946 3669\",\"cl_email_address\":\"southkensington@medicspot.co.uk\",\"cl_description\":\"Your South Kensington MedicSpot Clinic is located in the consultation suite at Harley&rsquo;s Chemist on 35-37 Old Brompton Road, SW7 3HZ &ndash; just a stone throw away from South Kensington Underground Station. It&rsquo;s better to book your appointment online before you go, but you can also simply walk in without a booking to see one of our expert doctors. If you live or work in South Kensington then using MedicSpot for your GP health needs will be ideal for you. There is sufficient room for wheelchair access and we are happy to provide additional assistance to our patients.\",\"cl_lat\":\"51.493434\",\"cl_lng\":\"-0.175115\",\"cl_formatted_address\":\"35-37 Old Brompton Rd, Kensington, London SW7 3HZ, UK\",\"1_image\":\"MedicSpot_Clinic_South_Kensington_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_South_Kensington_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_South_Kensington_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/kensington-chelsea\\/kensington\\/south-kensington-clinic\",\"ref\":\"MSPOT19\",\"pharmacy_name\":\"Harleys Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 2, '2017-12-15 08:03:00', 1),
