(364, 30, 'ea_clinics', '{\"id\":\"30\",\"cl_clinic_name\":\"MedicSpot Clinic Notting Hill\",\"cl_address_line_1\":\"12 Pembridge Road\",\"cl_address_line_2\":\"Notting Hill\",\"cl_postcode\":\"W11 3HL\",\"cl_phone_number\":\"020 3946 3661\",\"cl_email_address\":\"nottinghill@medicspot.co.uk\",\"cl_description\":\"This MedicSpot clinic is located inside Notting Hill Pharmacy &ndash; 12 Pembridge Road, W11 3HL &ndash; couple of minutes from Notting Hill Gate Underground Station. The clinic is very close to Hyde Park and Kensington Gardens. We provide a high-quality GP service where you canwalk in and be seen by a doctor within minutes. Prescriptions can be picked up instantly on your way out after your MedicSpot consultation.\",\"cl_lat\":\"51.509462\",\"cl_lng\":\"-0.196981\",\"cl_formatted_address\":\"12 Pembridge Rd, Notting Hill, London W11 3HL, UK\",\"1_image\":\"MedicSpot_Clinic_Nothing_Hill_Virtual_Consultation.JPG\",\"2_image\":\"MedicSpot_Clinic_Notting_Hill_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Notting_Hill_walk_in_centre_inside.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/kensington-chelsea\\/notting-hill\\/notting-hill-clinic\",\"ref\":\"MSPOT15\",\"pharmacy_name\":\"Notting Hill Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 3, '2017-12-15 08:05:29', 1),
(365, 51, 'ea_clinics', '{\"id\":\"51\",\"cl_clinic_name\":\"MedicSpot Clinic Woolwich\",\"cl_address_line_1\":\"10 Woolwich New Road\",\"cl_address_line_2\":\"Woolwich\",\"cl_postcode\":\"SE18 6EX\",\"cl_phone_number\":\"020 3946 3999\",\"cl_email_address\":\"woolwich@medicspot.co.uk\",\"cl_description\":\"The Woolwich MedicSpot clinic is located in Equitable House on 10 Woolwich New Road, SE18 6EX &ndash; seconds away from Woolwich Arsenal train station and DLR. We offer a private GP service where anyone can walk in and instantly be seen by one of our doctors. The location of this clinic makes it ideal for those who commute regularly, shoppers and residents who want to be seen quickly by one of the MedicSpot GPs. If you wish to see one of our GPs then book online using our quick booking form or alternatively simply just walk in and ask to see a GP.\",\"cl_lat\":\"51.4906826\",\"cl_lng\":\"0.0696306\",\"cl_formatted_address\":\"10 Woolwich New Rd, Woolwich, London SE18 6EX, UK\",\"1_image\":\"MedicSpot_Clinic_Woolwich_Consutling_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Woolwich_Virtual_Consultation_1.JPG\",\"3_image\":\"MedicSpot_Clinic_Woolwich_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/greenwich\\/woolwich\\/woolwich-clinic\",\"ref\":\"\",\"pharmacy_name\":\"\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 3, '2017-12-15 08:10:29', 1),
(366, 29, 'ea_clinics', '{\"id\":\"29\",\"cl_clinic_name\":\"MedicSpot Clinic Wilesden\",\"cl_address_line_1\":\"70-72 Walm Lane\",\"cl_address_line_2\":\"Wilesden\",\"cl_postcode\":\"NW2 4RA\",\"cl_phone_number\":\"020 3946 3599\",\"cl_email_address\":\"wilesden@medicspot.co.uk\",\"cl_description\":\"This MedicSpot clinic is located inside Craig Thompson Pharmacy at 70-72 Walm Lane, NW2 4RA &ndash; few minutes walk from Willesden Green Station and Sainsbury&rsquo;s local. It is perfect for residents and commuters who want to be seen by a GP immediately without having to wait days for an appointment. You can walk in, be seen by a doctor and leave with your prescription. It&rsquo;s as simple as that.\",\"cl_lat\":\"51.548275\",\"cl_lng\":\"-0.221969\",\"cl_formatted_address\":\"70-72 Walm Ln, Willesden, London NW2 4RA, UK\",\"1_image\":\"MedicSpot_Clinic_Wilesden_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Wilesden_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Wilesden_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/brent\\/wilesden\\/wilesden-clinic\",\"ref\":\"\",\"pharmacy_name\":\"\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 2, '2017-12-15 08:12:12', 1),
(367, 25, 'ea_clinics', '{\"id\":\"25\",\"cl_clinic_name\":\"MedicSpot Clinic Paddington\",\"cl_address_line_1\":\"107 Praed Street\",\"cl_address_line_2\":\"\",\"cl_postcode\":\"W2 1NT\",\"cl_phone_number\":\"020 3937 9936\",\"cl_email_address\":\"paddington@medicspot.co.uk\",\"cl_description\":\"This MedicSpot clinic is located in Apek Pharmacy on 107 Praed Street, W2 1NT &ndash; directly opposite the main entrance of St. Marys Hospital. You can easily get here from Edgware Road and Paddington Underground Stations which are both minutes walk. If you are tired of waiting for weeks for an appointment with your usual GP then this is perfect for you as you just have to turn up at a time that suits and see one of our expert GPs instantly. No pre-booking required!\",\"cl_lat\":\"51.5172603\",\"cl_lng\":\"-0.1723911\",\"cl_formatted_address\":\"107 Praed Street, Paddington, London W2 1NT, United Kingdom\",\"1_image\":\"MedicSpot_Clinic_Paddington_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Paddington_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Paddington_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/westminster\\/paddington\\/paddington-clinic\",\"ref\":\"MSPOT10\",\"pharmacy_name\":\"Apek Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 3, '2017-12-15 08:13:40', 1),
