(371, 44, 'ea_clinics', '{\"id\":\"44\",\"cl_clinic_name\":\"MedicSpot Clinic Portobello Market\",\"cl_address_line_1\":\"202 Portobello Road\",\"cl_address_line_2\":\"Notting Hill\",\"cl_postcode\":\"W11 1LA\",\"cl_phone_number\":\"020 3946 3808\",\"cl_email_address\":\"portobellomarket@medicspot.co.uk\",\"cl_description\":\"Your Noting Hill MedicSpot clinic is located inside our consultation room at Blenheim Pharmacy on 202 Portobello Road, W11 1LA &ndash; few doors down from Sainsbury&rsquo;s Local and opposite Poundland. It is ideally situated minutes walk from both Ladbroke Grove and Westbourne Park underground stations. Once at the clinic, you will be seen by one of our specialist GPs in minutes and you can collect your prescription instantly on the way out allowing for a wait-free speedy service.\",\"cl_lat\":\"51.51643\",\"cl_lng\":\"-0.205142\",\"cl_formatted_address\":\"202 Portobello Rd, London W11 1LA, UK\",\"1_image\":\"MedicSpot_Clinic_Portobello_Market_GP_Surgery_Outside.JPG\",\"2_image\":\"MedicSpot_Clinic_Pimlico_Virtual_Consultation.JPG\",\"3_image\":\"MedicSpot_Clinic_Pimlico_Consulting_Room.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/kensington-chelsea\\/notting-hill\\/portobello-market-clinic\",\"ref\":\"MSPOT28\",\"pharmacy_name\":\"Blenheim Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 3, '2017-12-15 08:23:35', 1),
