(373, 40, 'ea_clinics', '{\"id\":\"40\",\"cl_clinic_name\":\"MedicSpot Clinic Primrose Hill\",\"cl_address_line_1\":\"28 England\'s Lane\",\"cl_address_line_2\":\"Primrose Hill\",\"cl_postcode\":\"NW3 4UE\",\"cl_phone_number\":\"020 3946 3688\",\"cl_email_address\":\"primrosehill@medicspot.co.uk\",\"cl_description\":\"This MedicSpot clinic is found in Allchin Pharmacy at 28 England&rsquo;s Lane, NW3 4UE1 &ndash; on the corner with Primrose Gardens. Chalk Farm is the closest underground station with Belsize Park and Swiss Cottage underground stations also being very close. We offer a private GP service where anyone can walk in and instantly be seen by one of our doctors. This clinic is convenient for those who work and live in the area or those visiting London Zoo which is a twenty-minute walk. Booking an appointment online is recommended, but not necessary.\",\"cl_lat\":\"51.5461186\",\"cl_lng\":\"-0.1620878\",\"cl_formatted_address\":\"28 England\'s Ln, Primrose Hill, London NW3 4UE, UK\",\"1_image\":\"MedicSpot_Clinic_Primrose_Hill_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Primrose_Hill_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Primrose_Hill_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"url\":\"england\\/london\\/camden\\/primrose-hill\\/primrose-hill-clinic\",\"ref\":\"MSPOT24\",\"pharmacy_name\":\"Allchin Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 2, '2017-12-15 08:28:35', 1),
