(392, 48, 'ea_clinics', '{\"id\":\"48\",\"cl_clinic_name\":\"MedicSpot Clinic Cambridge\",\"cl_address_line_1\":\"28-30 Trumpington Street\",\"cl_address_line_2\":\"Cambridge\",\"cl_postcode\":\"CB2 1QZ\",\"cl_phone_number\":\"01223 800935\",\"cl_email_address\":\"cambridge@medicspot.co.uk\",\"cl_description\":\"The Cambridge MedicSpot clinic is situated inside the Fitzwilliam Pharmacy at 28-30 Trumpington Road, CB2 1QZ &ndash; on a corner with Fitzwilliam Street. It is located directly opposite the Fitzwilliam Museum and close to many of the university campuses making it ideal for students who are reluctant to wait for appointments with their regular GP and wish to see a doctor on the same day. If you live, work or study in the city and want to be seen by a GP then come to our MedicSpot clinic where you will be seen by one of our expert doctors within minutes. Prescriptions can be picked up directly after your consultation allowing for a fast service. No booking required, although recommended.\",\"cl_lat\":\"52.200338\",\"cl_lng\":\"0.120241\",\"cl_formatted_address\":\"28-30 Trumpington St, Cambridge CB2 1QZ, UK\",\"1_image\":\"MedicSpot_Clinic_Cambridge_GP_Surgery_Outside.jpg\",\"2_image\":\"MedicSpot_Clinic_Cambridge_Virtual_Consultation.jpg\",\"3_image\":\"MedicSpot_Clinic_Cambridge_walk_in_centre_inside.jpg\",\"meta_keywords\":\"\",\"meta_description\":\"Same day doctor and GP service in Cambridge - close to city centre and university campuses. Learn more.\",\"url\":\"england\\/cambridgeshire\\/cambridge\\/cambridge-clinic\",\"ref\":\"MSPOT32\",\"pharmacy_name\":\"Fitzwilliam Pharmacy\",\"alias_url\":\"england\\/cambridgeshire\\/cambridge\\/cambridge-clinic\\/medicspot-clinic-cambridge\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 6, '2017-12-16 10:57:30', 1),
(393, 39, 'ea_clinics', '{\"id\":\"39\",\"cl_clinic_name\":\"MedicSpot Clinic Chelsea\",\"cl_address_line_1\":\"469 King\'s Road\",\"cl_address_line_2\":\"Chelsea\",\"cl_postcode\":\"SW10 0LU\",\"cl_phone_number\":\"020 3946 3686\",\"cl_email_address\":\"chelsea@medicspot.co.uk\",\"cl_description\":\"Your Chelsea MedicSpot clinic is situated within Worlds End Pharmacy at 469 King&rsquo;s Road, SW1V 1RY &ndash; just a minute&rsquo;s walk from the Chelsea Theatre and next door to the Co-Op supermarket. This clinic is located within walking distance from the famous Stamford Bridge football stadium and Fulham Broadway Underground Station. We offer an excellent private GP walk-in service where no booking is necessary. Any medication prescribed by our MedicSpot doctor can be collected on your way out making for a hassle-free service.\",\"cl_lat\":\"51.481725\",\"cl_lng\":\"-0.180568\",\"cl_formatted_address\":\"469 King\'s Rd, Chelsea, London SW10 0LU, UK\",\"1_image\":\"MedicSpot_Clinic_Chelsea_consulting_room.jpg\",\"2_image\":\"MedicSpot_Clinic_Chelsea_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Chelsea_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Walk in GP service with qualified NHS doctors, based in Chelsea. Find out more.\",\"url\":\"england\\/london\\/kensington-chelsea\\/chelsea\\/chelsea-clinic\",\"ref\":\"MSPOT23\",\"pharmacy_name\":\"Worlds End Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 4, '2017-12-16 10:58:40', 1),
(395, 16, 'ea_clinics', '{\"id\":\"16\",\"cl_clinic_name\":\"MedicSpot Clinic Cricklewood\",\"cl_address_line_1\":\"6 Cricklewood Broadway\",\"cl_address_line_2\":\"Cricklewood\",\"cl_postcode\":\"NW2 3HD\",\"cl_phone_number\":\"020 3937 5656\",\"cl_email_address\":\"cricklewood@medicspot.co.uk\",\"cl_description\":\"The Cricklewood MedicSpot clinic is located in Greenlight Pharmacy on 6 Cricklewood Broadway, NW2 3HD &ndash; a few doors down from the Co-op food supermarket. We offer a private same day doctor service where you can walk in and see one of our expert doctors or alternatively you can book an appointment online. You can pick up prescriptions straight after the consultation making the whole process quick and simple.\",\"cl_lat\":\"51.55285\",\"cl_lng\":\"-0.210386\",\"cl_formatted_address\":\"6 Cricklewood Broadway, Cricklewood, London NW2 3HD, UK\",\"1_image\":\"MedicSpot_Clinic_Cricklewood_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Cricklewood_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Cricklewood_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Same day private doctor service in Cricklewood, offering walk in GP consultations. Find out more.\",\"url\":\"england\\/london\\/camden\\/cricklewood\\/cricklewood-clinic\",\"ref\":\"MSPOT1\",\"pharmacy_name\":\"Greenlight Cricklewood\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 8, '2017-12-16 11:00:20', 1),
(396, 26, 'ea_clinics', '{\"id\":\"26\",\"cl_clinic_name\":\"MedicSpot Clinic Earls Court\",\"cl_address_line_1\":\"240 Earls Court Road\",\"cl_address_line_2\":\"Kensington\",\"cl_postcode\":\"SW5 9AA\",\"cl_phone_number\":\"020 3946 3550\",\"cl_email_address\":\"earlscourt@medicspot.co.uk\",\"cl_description\":\"This clinic is located in Earls Court Chemist on 240 Earls Court Road, SW5 9AA. It is conveniently located exactly two doors down from the Earls Court Underground Station. If you wish to be seen by a doctor straightaway then come into our MedicSpot clinic at a time that suits you. Book online or simply just walk in and ask to see a GP.\",\"cl_lat\":\"51.4920293\",\"cl_lng\":\"-0.192987\",\"cl_formatted_address\":\"240 Earls Court Road, Kensington, London SW5 9AA, United Kingdom\",\"1_image\":\"MedicSpot_Clinic_Earls_Court_consulting_room.JPG\",\"2_image\":\"MedicSpot_Clinic_Earls_Court_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Earls_Court_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Walk in GP consultation service based in Earl\'s Court, London. Affordable same day doctor service - learn more.\",\"url\":\"england\\/london\\/kensington-chelsea\\/kensington\\/earls-court-clinic\",\"ref\":\"MSPOT11\",\"pharmacy_name\":\"Earls Court Chemist\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 5, '2017-12-16 11:01:19', 1),
