(398, 49, 'ea_clinics', '{\"id\":\"49\",\"cl_clinic_name\":\"MedicSpot Clinic Edinburgh\",\"cl_address_line_1\":\"46-48 Clerk Street\",\"cl_address_line_2\":\"Edinburgh\",\"cl_postcode\":\"EH8 9JB\",\"cl_phone_number\":\"0131 3578887\",\"cl_email_address\":\"edinburgh@medicspot.co.uk\",\"cl_description\":\"The Edinburgh clinic is located in Newington Pharmacy on 46-48 Clerk Street, EH8 9JB &ndash; few minutes walk from University of Edinburgh. It&rsquo;s better to book your appointment online before you go, but you can simply walk in without booking to see one of our expert doctors. If you are a student, live or work in the city then using MedicSpot for your GP health needs will be ideal for you as it is a cheap and easy service. This clinic is wheelchair accessible and we can provide further assistance to our patients if required.\",\"cl_lat\":\"55.942144\",\"cl_lng\":\"-3.181826\",\"cl_formatted_address\":\"46-48 Clerk St, Edinburgh EH8 9JB, UK\",\"1_image\":\"MedicSpot_Clinic_Edinburgh_consulting_room.JPG\",\"2_image\":\"MedicSpot_Clinic_Edinburgh_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Edinburgh_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Edinburgh-based same day walk in GP consultation service. Affordable private service - learn more.\",\"url\":\"scotland\\/edinburgh\\/edinburgh\\/edinburgh-clinic\",\"ref\":\"MSPOT33\",\"pharmacy_name\":\"Newington Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 5, '2017-12-16 11:03:04', 1),
(399, 38, 'ea_clinics', '{\"id\":\"38\",\"cl_clinic_name\":\"MedicSpot Clinic Elephant & Castle\",\"cl_address_line_1\":\"46 St George\'s Road\",\"cl_address_line_2\":\"Newington\",\"cl_postcode\":\"SE1 6ET\",\"cl_phone_number\":\"020 3946 3684\",\"cl_email_address\":\"elephantandcastle@medicspot.co.uk\",\"cl_description\":\"This MedicSpot walk in GP clinic is located in St. George&rsquo;s Pharmacy at 46 St George&rsquo;s Road, SE1 6ET &ndash; less than five-minute walk from Elephant & Castle Shopping Centre and across the road from Elephant & Castle underground station. This location is convenient for people shopping, living or working in the area. MedicSpot provides a quick and affordable private GP service where anyone can walk in and been seen by one of our expert GPs. If you are prescribed medicine, your prescription can be collected from pharmacy straight after the consultation.\",\"cl_lat\":\"51.4957\",\"cl_lng\":\"-0.101953\",\"cl_formatted_address\":\"46 St George\'s Rd, Newington, London SE1 6ET, UK\",\"1_image\":\"MedicSpot_Clinic_Elephant_and_Castle_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Elephant_and_Castle_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Elephant_and_Castle_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Affordable same day GP service based in Elephant and Castle. Learn more here.\",\"url\":\"england\\/london\\/southwark\\/newington\\/elephant-castle-clinic\",\"ref\":\"MSPOT22\",\"pharmacy_name\":\"St Georges Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 3, '2017-12-16 11:03:37', 1),
(400, 17, 'ea_clinics', '{\"id\":\"17\",\"cl_clinic_name\":\"MedicSpot Clinic Euston\",\"cl_address_line_1\":\"62-64 Hampstead Road\",\"cl_address_line_2\":\"Euston\",\"cl_postcode\":\"NW1 2NT\",\"cl_phone_number\":\"020 3937 5666\",\"cl_email_address\":\"euston@medicspot.co.uk\",\"cl_description\":\"The Euston MedicSpot clinic is located in Greenlight Pharmacy at 62 Hampstead Road, NW1 2NT. This clinic is located in the heart of the city centre very close to the famous Euston and Kings Cross train stations. We provide a private GP service where anyone can walk-in and see a doctor instantly. The location of this clinic makes it ideal for those who work in one of the many offices nearby. If you are a tourist sightseeing in central London, this can be an easy way to see a doctor at an affordable price. You can collect your prescriptions instantly after the consultation from the pharmacy. You can book an appointment online or simply walk in and be seen quickly by one of our expert GP&rsquo;s.\",\"cl_lat\":\"51.5266968\",\"cl_lng\":\"-0.1384472\",\"cl_formatted_address\":\"62-64 Hampstead Rd, Kings Cross, London NW1 2NT, UK\",\"1_image\":\"MedicSpot_Clinic_Euston_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Euston_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Euston_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Instant doctor consultation service, based in Euston, London. Find out more here.\",\"url\":\"england\\/london\\/camden\\/euston\\/euston-clinic\",\"ref\":\"MSPOT2\",\"pharmacy_name\":\"Greenlight Pharmacy Euston\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 3, '2017-12-16 11:04:14', 1),
(401, 28, 'ea_clinics', '{\"id\":\"28\",\"cl_clinic_name\":\"MedicSpot Clinic Glasgow Centre\",\"cl_address_line_1\":\"128 High Street\",\"cl_address_line_2\":\"Glasgow\",\"cl_postcode\":\"G1 1PQ\",\"cl_phone_number\":\"0141 406 5808\",\"cl_email_address\":\"glasgowcentre@medicspot.co.uk\",\"cl_description\":\"The Glasgow City Centre MedicSpot Walk In GP Clinic is located at 128 High Street, G1 1PQ inside Glasgow High Street Pharmacy &ndash; just at the end of Ingram Street next door to Aldi. We offer convenient and affordable private GP consultations with prescriptions to patients in surrounding areas such as Paisley and Clydebank in addition to Glasgow. You can either pre-book or you can choose to turn up and see the doctor at a time whenever it suits. There is good wheelchair access at this clinic.\",\"cl_lat\":\"55.859139\",\"cl_lng\":\"-4.240898\",\"cl_formatted_address\":\"128 High St, Glasgow G1 1PQ, UK\",\"1_image\":\"MedicSpot_Clinic_Glasgow_Centre_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Glasgow_Centre_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Glasgow_Centre_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Affordable walk in GP consultation service, based in Glasgow city centre. Find out more.\",\"url\":\"scotland\\/glasgow\\/glasgow\\/glasgow-centre-clinic\",\"ref\":\"MSPOT13\",\"pharmacy_name\":\"High Street Pharmacy Glasgow\",\"alias_url\":\"scotland\\/glasgow\\/glasgow-centre\\/glasgow-centre-clinic\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 5, '2017-12-16 11:04:59', 1);
