(402, 47, 'ea_clinics', '{\"id\":\"47\",\"cl_clinic_name\":\"MedicSpot Clinic Grosvenor Square\",\"cl_address_line_1\":\"36 South Audley Street\",\"cl_address_line_2\":\"Mayfair\",\"cl_postcode\":\"W1K  2PL\",\"cl_phone_number\":\"020 3946 3909\",\"cl_email_address\":\"grosvenorsquare@medicspot.co.uk\",\"cl_description\":\"This Mayfair MedicSpot same day doctor clinic is located at 36 South Audley Street, W1K 2PL &ndash; inside the Audley Pharmacy. This clinic is located very close to Hyde Park with Marble Arch and Hyde Park Corner underground stations within minutes. Seeing a MedicSpot GP would be a convenient alternative to your regular GP for people living or working within the area. Our clinic allows people to walk in or pre-book and be seen by an expert GP instantly. If your MedicSpot doctor prescribes you medicine, you can instantly collect it after your consultation from the pharmacy.\",\"cl_lat\":\"51.5097839\",\"cl_lng\":\"-0.1516887\",\"cl_formatted_address\":\"36 S Audley St, Mayfair, London W1K 2PL, UK\",\"1_image\":\"MedicSpot_Clinic_Grosvenor_Square_GP_Surgery_Outside.JPG\",\"2_image\":\"MedicSpot_Clinic_Grosvenor_Square_Virtual_Consultation.JPG\",\"3_image\":\"MedicSpot_Clinic_Grosvenor_Square_walk_in_centre_inside.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Same day doctor \\/ walk in GP service in Mayfair, London. Find out more.\",\"url\":\"england\\/london\\/westminster\\/mayfair\\/grosvenor-square-clinic\",\"ref\":\"MSPOT31\",\"pharmacy_name\":\"Audley Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 3, '2017-12-16 11:05:34', 1),
(403, 21, 'ea_clinics', '{\"id\":\"21\",\"cl_clinic_name\":\"MedicSpot Clinic Harrow on the Hill\",\"cl_address_line_1\":\"18 College Road\",\"cl_address_line_2\":\"\",\"cl_postcode\":\"HA1 1BE\",\"cl_phone_number\":\"020 3937 9882\",\"cl_email_address\":\"harrowonthehill@medicspot.co.uk\",\"cl_description\":\"Your Harrow MedicSpot walk in doctor clinic is located in our consultation room at the Keencare Pharmacy on 18 College Street, HA1 1BE &ndash; it is seconds walk from St-Anns Shopping Centre and minutes from Harrow-on-the-Hill Underground Station. It is conveniently located for those who are out shopping, work or live nearby or those who have not registered with a GP. Harrow residents finally have access to world-class healthcare at an affordable price; without the waits.\",\"cl_lat\":\"51.5801908\",\"cl_lng\":\"-0.3353198\",\"cl_formatted_address\":\"18 College Road, Harrow, London HA1 1BE, United Kingdom\",\"1_image\":\"MedicSpot_Clinic_Harrow_on_the_Hill_GP_Surgery_Outside.jpg\",\"2_image\":\"MedicSpot_Clinic_Harrow_on_the_Hill_Consulting_Room.JPG\",\"3_image\":\"MedicSpot_Clinic_Harrow_on_the_Hill_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Walk in GP service based in Harrow on the Hill. Learn more about the MedicSpot clinic service.\",\"url\":\"england\\/london\\/harrow\\/harrow\\/harrow-on-the-hill-clinic\",\"ref\":\"MSPOT6\",\"pharmacy_name\":\"Keencare Pharmacy Harrow\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 5, '2017-12-16 11:06:28', 1),
(404, 27, 'ea_clinics', '{\"id\":\"27\",\"cl_clinic_name\":\"MedicSpot Clinic Holborn\",\"cl_address_line_1\":\"41 Bloomsbury Way\",\"cl_address_line_2\":\"\",\"cl_postcode\":\"WC1A 2SA\",\"cl_phone_number\":\"020 3946 3555\",\"cl_email_address\":\"holborn@medicspot.co.uk\",\"cl_description\":\"Should you wish to seek medical attention, then come and visit our MedicSpot walk in GP clinic in Kerrs Chemist on 41 Bloomsbury Way, WC1A 2SA where you can be seen by a GP within minutes. Our clinic is only minutes away from Holborn Underground Station and Tottenham Court Road Underground Station. Booking an appointment is recommended but you can easily just walk in and be seen by one of our skillful GPs for an affordable price.\",\"cl_lat\":\"51.5173313\",\"cl_lng\":\"-0.1248945\",\"cl_formatted_address\":\"41 Bloomsbury Way, Holborn, London WC1A 2SA, UK\",\"1_image\":\"MedicSpot_Clinic_Holborn_Consulting_room.JPG\",\"2_image\":\"MedicSpot_Clinic_Holborn_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Holborn_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Walk in doctor service in Holborn. See a doctor on the same day - learn more here.\",\"url\":\"england\\/london\\/camden\\/holborn\\/holborn-clinic\",\"ref\":\"MSPOT12\",\"pharmacy_name\":\"Kerrs Chemist\",\"alias_url\":\"england\\/london\\/camden\\/holborn\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 4, '2017-12-16 11:07:02', 1),
(405, 46, 'ea_clinics', '{\"id\":\"46\",\"cl_clinic_name\":\"MedicSpot Clinic Holland Park\",\"cl_address_line_1\":\"106 Holland Park Avenue\",\"cl_address_line_2\":\"Holland Park\",\"cl_postcode\":\"W11 4UA\",\"cl_phone_number\":\"020 3946 3888\",\"cl_email_address\":\"hollandpark@medicspot.co.uk\",\"cl_description\":\"This MedicSpot same day doctor clinic can be found at 106 Holland Park, W11 4UA, inside Hillcrest Pharmacy &ndash; seconds from Holland Park and minutes from Shepherds Bush stations making it close to the famous Westfield Shopping Centre. MedicSpot offers instant consultations with our expert GPs for an affordable price. This is convenient for people who want to be seen quickly, without the hassle of waiting around. Booking online is recommended but it is not necessary.\",\"cl_lat\":\"51.5069636\",\"cl_lng\":\"-0.2072609\",\"cl_formatted_address\":\"106 Holland Park Ave, Holland Park, London W11 4UA, UK\",\"1_image\":\"MedicSpot_Clinic_Holland_Park_GP_Surgery_Outside.JPG\",\"2_image\":\"MedicSpot_Clinic_Holland_Park_Virtual_Consultation.JPG\",\"3_image\":\"MedicSpot_Clinic_Holland_Park_walk_in_centre_inside.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Same day doctor service in Holland Park. An affordable local walk in GP service. Learn more.\",\"url\":\"england\\/london\\/kensington-chelsea\\/holland-park\\/holland-park-clinic\",\"ref\":\"MSPOT30\",\"pharmacy_name\":\"Hillcrest Pharmacy\",\"alias_url\":\"england\\/london\\/kensington-chelsea\\/holland-park\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 4, '2017-12-16 11:07:48', 1),
(406, 32, 'ea_clinics', '{\"id\":\"32\",\"cl_clinic_name\":\"MedicSpot Clinic Isleworth\",\"cl_address_line_1\":\"1 Shrewsbury Walk\",\"cl_address_line_2\":\"\",\"cl_postcode\":\"TW7 7DE\",\"cl_phone_number\":\"020 3917 6896\",\"cl_email_address\":\"isleworth@medicspot.co.uk\",\"cl_description\":\"Our MedicSpot walk in GP service Clinic Isleworth is located inside Riverside Pharmacy which is an extended hour pharmacy - open until 22.30 each day.  It\'s located in the Woodlands area near West Middlesex Hospital on the junction of South Street and Shrewsbury Walk.  If you need a quick GP appointment, then simply book online and then go to the pharmacy to be instantly connected to one of our expert doctors.\",\"cl_lat\":\"51.4682881\",\"cl_lng\":\"-0.325005\",\"cl_formatted_address\":\"1 Shrewsbury Walk, Isleworth TW7 7DE, UK\",\"1_image\":\"MedicSpot_Clinic_Isleworth_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Isleworth_GP_Surgery_Outside.jpg\",\"3_image\":\"MedicSpot_Clinic_Isleworth_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"AFfordable same day doctor service in Isleworth, Middlesex. Find out more here.\",\"url\":\"england\\/london\\/hounslow\\/isleworth\\/isleworth-clinic\",\"ref\":\"\",\"pharmacy_name\":\"\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 6, '2017-12-16 11:09:04', 1),
