(418, 18, 'ea_clinics', '{\"id\":\"18\",\"cl_clinic_name\":\"MedicSpot Clinic Shepherds Bush\",\"cl_address_line_1\":\"228-230 Uxbridge Road\",\"cl_address_line_2\":\"London\",\"cl_postcode\":\"W12 7JD\",\"cl_phone_number\":\"020 3937 7710\",\"cl_email_address\":\"shepherdsbush@medicspot.co.uk\",\"cl_description\":\"This MedicSpot walk in GP clinic is located in the consulting room of GreenLight Pharmacy on 228 Uxbridge Road, Shepherd&rsquo;s Bush, W12 7DJ &ndash; very close to Westfield Shopping Centre. Our doctors have already helped many patients who live, work or shop in the area and are looking forward to helping many more. It&rsquo;s preferable if you use our quick online booking system to book before you come, but if you&rsquo;re in the area already and feel unwell &ndash; simply just walk in and be on the road to recovery after seeing one of our doctors. If you are prescribed medicine, this can be collected from pharmacy straight after the consultation.\",\"cl_lat\":\"51.5058975\",\"cl_lng\":\"-0.2277367\",\"cl_formatted_address\":\"228-230 Uxbridge Road, Shepherds Bush, London W12 7JD, United Kingdom\",\"1_image\":\"MedicSpot_Clinic_Shepherds_Bush_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Shepherds_Bush_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Shepherds_Bush_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Walk in to a same day doctor consultation in Shepherds Bush. Find out more about the service here.\",\"url\":\"england\\/london\\/hammersmith-fulham\\/shepherds-bush\\/shepherds-bush-clinic\",\"ref\":\"MSPOT3\",\"pharmacy_name\":\"Greenlight Shepherds Bush\",\"alias_url\":\"england\\/london\\/hammersmith-fulham\\/shepherds-bush\",\"alias_url2\":\"england\\/london\\/hammersmith-fulham\\/shepherds-bush\\/inside-greenlight-pharmacy-at-shepherds-bush\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 8, '2017-12-16 11:17:48', 1),
(419, 35, 'ea_clinics', '{\"id\":\"35\",\"cl_clinic_name\":\"MedicSpot Clinic South Kensington\",\"cl_address_line_1\":\"35-37 Old Brompton Road\",\"cl_address_line_2\":\"Kensington\",\"cl_postcode\":\"SW7 3HZ\",\"cl_phone_number\":\"020 3946 3669\",\"cl_email_address\":\"southkensington@medicspot.co.uk\",\"cl_description\":\"Your South Kensington MedicSpot Clinic same day doctor service is located in the consultation suite at Harley&rsquo;s Chemist on 35-37 Old Brompton Road, SW7 3HZ &ndash; just a stone throw away from South Kensington Underground Station. It&rsquo;s better to book your appointment online before you go, but you can also simply walk in without a booking to see one of our expert doctors. If you live or work in South Kensington then using MedicSpot for your GP health needs will be ideal for you. There is sufficient room for wheelchair access and we are happy to provide additional assistance to our patients.\",\"cl_lat\":\"51.493434\",\"cl_lng\":\"-0.175115\",\"cl_formatted_address\":\"35-37 Old Brompton Rd, Kensington, London SW7 3HZ, UK\",\"1_image\":\"MedicSpot_Clinic_South_Kensington_Consulting_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_South_Kensington_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_South_Kensington_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Visit a GP on the same day in South Kensington with the MedicSpot walk in GP service. Find out more.\",\"url\":\"england\\/london\\/kensington-chelsea\\/kensington\\/south-kensington-clinic\",\"ref\":\"MSPOT19\",\"pharmacy_name\":\"Harleys Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 3, '2017-12-16 11:18:31', 1),
