(428, 51, 'ea_clinics', '{\"id\":\"51\",\"cl_clinic_name\":\"MedicSpot Clinic Woolwich\",\"cl_address_line_1\":\"10 Woolwich New Road\",\"cl_address_line_2\":\"Woolwich\",\"cl_postcode\":\"SE18 6EX\",\"cl_phone_number\":\"020 3946 3999\",\"cl_email_address\":\"woolwich@medicspot.co.uk\",\"cl_description\":\"The Woolwich MedicSpot same day GP clinic is located in Equitable House on 10 Woolwich New Road, SE18 6EX &ndash; seconds away from Woolwich Arsenal train station and DLR. We offer a private GP service where anyone can walk in and instantly be seen by one of our doctors. The location of this clinic makes it ideal for those who commute regularly, shoppers and residents who want to be seen quickly by one of the MedicSpot GPs. If you wish to see one of our GPs then book online using our quick booking form or alternatively simply just walk in and ask to see a GP.\",\"cl_lat\":\"51.4906826\",\"cl_lng\":\"0.0696306\",\"cl_formatted_address\":\"10 Woolwich New Rd, Woolwich, London SE18 6EX, UK\",\"1_image\":\"MedicSpot_Clinic_Woolwich_Consutling_Room.JPG\",\"2_image\":\"MedicSpot_Clinic_Woolwich_Virtual_Consultation_1.JPG\",\"3_image\":\"MedicSpot_Clinic_Woolwich_Virtual_Consultation.JPG\",\"meta_keywords\":\"\",\"meta_description\":\"Same day walk in GP service in Woolwich, London. Learn more about the service here.\",\"url\":\"england\\/london\\/greenwich\\/woolwich\\/woolwich-clinic\",\"ref\":\"\",\"pharmacy_name\":\"\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 4, '2017-12-16 11:25:03', 1),
(429, 6, 'articles', '{\"id\":\"6\",\"title\":\"Navigating Through Sick Notes\",\"slug\":\"navigating-through-sick-notes\",\"author_id\":\"1\",\"content\":\"Q) Why do I need a sick note?\\r\\nSick notes are generally used to show your employer that you are unwell and need time off work.  They can also be used to advice your employer that you need a change in your working hours, work duties or adaptations made at work.  Other organisations such as colleges and Universities may also ask for them, particularly if you perform poorly or miss an exam due to being unwell. \\r\\n\\r\\nQ) How long do I need to be ill for before I can get a sick note?\\r\\nYour NHS GP is only able to provide a sick note if you have been sick for 7 days (5 working days) or more.  If you have been ill for less than that, then you will be asked to fill in and complete a self certification\\/employee&rsquo;s statement of sickness form available here.\\r\\n\\r\\nQ) What if my work insists on having a doctor&rsquo;s note instead of a self-certification form even if it&rsquo;s been less than 7 days?\\r\\nSome employers do insist on a doctor&rsquo;s note if you&rsquo;ve been sick for less than 7 days.  For this, you will need a private sick note &ndash; something which MedicSpot can help you with.\\r\\n\\r\\nQ) Does my employer have to abide by what is written on the sick note?\\r\\nNo, the sick note provided by the doctor is classified as advice and your employer does not legally need to act on that advice.  However, that said &ndash; it is very rare that your employer goes against the advice of the doctor.\\r\\n\\r\\nQ) Do I need a doctor to provide me with a sick note?\\r\\nYes, it needs to be signed by the doctor &ndash; normally a General Practitioner (GP.)  If you have been in hospital, then you should ask the hospital doctors to provide you with one.\\r\\n\\r\\nQ) Is a sick note, fit note, doctor note and a med3 the same thing?\\r\\nYes, these are all the same thing.  The term &ldquo;fit note&rdquo; replaced &ldquo;sick note&rdquo; in 2010.  The main reason for this change was to try and get people to go back to work even if they can&rsquo;t completely resume their normal duties.  Doctors often call these notes med3s, but their official title is a &lsquo;Statement of Fitness for Work.&rsquo;\\r\\n\\r\\nQ) Can sick notes be backdated?\\r\\nYes, doctors are legally allowed to backdate a sick note.  \\r\\n\\r\\nQ) How do I get a sick note?\\r\\nYou can get in touch with your own NHS GP to get a sick note.  However, if you need a private sick note if you&rsquo;ve been off work for less than 7 days or need a sick note at quick notice, then you can book an appointment with MedicSpot.  Our online doctors can speak with you and email you a sick note the very same day.  There is no additional charge for sick notes or more detailed letters.\",\"main_image\":\"medicspot_sick_note.png\",\"date_added\":\"2017-12-09 01:41:35\",\"published\":\"yes\",\"summary\":\"Navigating through sick notes, fit notes, doctors notes, med3s &ndash; whatever you call them &ndash; can get quite complicated especially if you&rsquo;ve been fortunate enough never to need them.  It can be difficult enough to jump through hoops to figure out if you need a sick note, why you need one or where to get one from at the best of times; let alone when you&rsquo;re feeling unwell.  Here&rsquo;s a handy guide we&rsquo;ve put together for reference.\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"created_at\":\"\"}', 4, '2018-01-04 07:28:08', 1),
