 note&rdquo; replaced &ldquo;sick note&rdquo; in 2010.  The main reason for this change was to try and get people to go back to work even if they can&rsquo;t completely resume their normal duties.  Doctors often call these notes med3s, but their official title is a &lsquo;Statement of Fitness for Work.&rsquo;\\r\\n\\r\\nQ) Can sick notes be backdated?\\r\\nYes, doctors are legally allowed to backdate a sick note.  \\r\\n\\r\\nQ) How do I get a sick note?\\r\\nYou can get in touch with your own NHS GP to get a sick note.  However, if you need a private sick note if you&rsquo;ve been off work for less than 7 days or need a sick note at quick notice, then you can book an appointment with MedicSpot.  Our online doctors can speak with you and email you a sick note the very same day.  There is no additional charge for sick notes or more detailed letters.\",\"main_image\":\"medicspot_sick_note.png\",\"date_added\":\"2017-12-09 01:41:35\",\"published\":\"yes\",\"summary\":\"Navigating through sick notes, fit notes, doctors notes, med3s &ndash; whatever you call them &ndash; can get quite complicated especially if you&rsquo;ve been fortunate enough never to need them.  It can be difficult enough to jump through hoops to figure out if you need a sick note, why you need one or where to get one from at the best of times; let alone when you&rsquo;re feeling unwell.  Here&rsquo;s a handy guide we&rsquo;ve put together for reference.\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"created_at\":\"\"}', 5, '2018-01-04 07:28:20', 1);
