(449, 43, 'ea_clinics', '{\"id\":\"43\",\"cl_clinic_name\":\"MedicSpot Clinic Battersea\",\"cl_address_line_1\":\"15 Battersea Rise\",\"cl_address_line_2\":\"Battersea\",\"cl_postcode\":\"SW11 1HG\",\"cl_phone_number\":\"020 3946 3694\",\"cl_email_address\":\"battersea@medicspot.co.uk\",\"cl_description\":\"Our Battersea clinic is located at Robards Pharmacy at 15 Battersea Rise, SW11 1HG. MedicSpot same day doctor service will provide you with an instant consultation with one of our expert GPs for an affordable price. It is very close to Clapham Junction Station, Clapham underground stations and the shopping centre. Our highly trained doctors have helped many patients who live, work or shop nearby and look forward to treating more. If you wish to see a GP for an affordable price, the come visit us for an instant consultation where you can puck up your prescription on your way out. No booking required!\",\"cl_lat\":\"51.460847\",\"cl_lng\":\"-0.163174\",\"cl_formatted_address\":\"15 Battersea Rise, Battersea, London SW11 1HG, UK\",\"1_image\":\"MedicSpot_Clinic_Battersea_Consulting_Room.jpg\",\"2_image\":\"MedicSpot_Clinic_Battersea_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Battersea_Virtual_Consultation.JPG\",\"page_title\":\"\",\"meta_title\":\"\",\"h1_title\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"Walk in, same day doctor service in Battersea, London. See a qualified GP quickly - find out more here.\",\"url\":\"england\\/london\\/wandsworth\\/battersea\\/battersea-clinic\",\"ref\":\"MSPOT27\",\"pharmacy_name\":\"Robards Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 6, '2018-01-05 10:14:20', 1),
(450, 34, 'ea_clinics', '{\"id\":\"34\",\"cl_clinic_name\":\"MedicSpot Clinic Clapham\",\"cl_address_line_1\":\"31 Clapham High Street\",\"cl_address_line_2\":\"Clapham\",\"cl_postcode\":\"SW4 7TR\",\"cl_phone_number\":\"020 3946 3667\",\"cl_email_address\":\"clapham@medicspot.co.uk\",\"cl_description\":\"The Clapham Medicspot walk in doctor\'s clinic at 31 Clapham High Street, SW4 7TR is located adjacent to Sainsbury&rsquo;s Local &ndash; just minutes away from Clapham North and Clapham Common underground stations. Our expert doctors have already helped many patients who live or work in the area. With great feedback, we aim to treat many more in the area. If you are tired of having to wait weeks for an appointment then come see one of our doctors for an affordable price. Like all of our MedicSpot clinics, this clinic is wheelchair accessible.\",\"cl_lat\":\"51.4642822\",\"cl_lng\":\"-0.1310743\",\"cl_formatted_address\":\"31 Clapham High St, Clapham, London SW4 7TR, UK\",\"1_image\":\"MedicSpot_Clinic_Clapham_consulting_room.JPG\",\"2_image\":\"MedicSpot_Clinic_Clapham_GP_Surgery_Outside.JPG\",\"3_image\":\"MedicSpot_Clinic_Clapham_Virtual_Consultation.JPG\",\"page_title\":\"Page Title\",\"meta_title\":\"MedicSpot Clinic Clapham Meta Title\",\"h1_title\":\"MedicSpot Clinic Clapham H1 Title\",\"meta_keywords\":\"\",\"meta_description\":\"Visit a qualified GP on the same day in Clapham, London. Find out more about the service here.\",\"url\":\"england\\/london\\/lambeth\\/clapham\\/clapham-clinic\",\"ref\":\"MSPOT18\",\"pharmacy_name\":\"Pearl Pharmacy\",\"alias_url\":\"\",\"alias_url2\":\"\",\"alias_url3\":\"\",\"alias_url4\":\"\"}', 11, '2018-01-05 10:15:14', 1),
