(378, 4, 'video_url', '', 'assets/video-placeholder.mp4', 'string', 'english', 'yes'),
(379, 4, 'body', '', 'Getting a GP appointment is hard enough even when you&rsquo;re feeling at your fighting best; let alone when you&rsquo;re unwell.\r\n\r\nMedicSpot is a new service which makes it simple and easy to get the care you need at a time and location suitable for you. Gone are the days of struggling to make an appointment, travelling to the surgery, late-running clinics all for a quick 10 minute appointment. MedicSpot is specifically designed to give you easy, quick and convenient access to high quality healthcare &ndash; no matter where you are or when you need it.', 'string', 'english', 'yes'),
(380, 4, 'sub_title', '', 'Medicspot Clinical Station', 'string', 'english', 'yes'),
(381, 4, 'small_body', '', 'MedicSpot uses the latest advancements in medical technology to not only allow our doctors to see and speak with you, but also to perform a full clinical examination through the MedicSpot Clinical Station. As doctors, MedicSpot&rsquo;s founders recognise the importance of carrying out an appropriate clinical examination and we know to leave nothing to chance. This allows MedicSpot&rsquo;s doctors to accurately diagnose you and give you the correct treatment.', 'string', 'english', 'yes'),
(382, 4, 'body_class', '', '', 'string', 'english', 'yes'),
