(407, 12, 'body', '', 'We are passionate about making basic healthcare more efficient, convenient & safe to everyone and we believe we do a good job at bringing this passion to life.\r\n<br>\r\nBut don&rsquo;t take our word for it. Here&rsquo;s what some of our regular customers have to say about us.', 'string', 'english', 'yes'),
