(409, 11, 'page_title', '', 'MedicSpot Same Day Doctor Service - About The Team', 'string', 'english', 'yes'),
(410, 11, 'meta_description', '', 'Find out more about the vastly experienced team behind the MedicSpot walk in GP service.', 'string', 'english', 'yes'),
(411, 11, 'meta_keywords', '', '', 'string', 'english', 'yes'),
(412, 11, 'heading', '', 'MedicSpot is a Healthcare Company that Aims to Revolutionise the Patient Journey.', 'string', 'english', 'yes'),
(413, 11, 'body', '', 'Our founders have all worked in the NHS and seen first hand the problems that the NHS and patients face. Through no fault of its own, the NHS is struggling to cope with rising demand from demographic shifts, more complex disease and a funding squeeze.\r\n<br>\r\nFar from trying to be a substitute for the NHS, MedicSpot hopes to complement the NHS to ensure that patients get care high quality at a time and place of their choosing. This will improve patient experience and outcomes &ndash; leading to a healthier nation.', 'string', 'english', 'yes'),
