INSERT INTO `reviews` (`id`, `name`, `desc`, `avatar_image`, `published`) VALUES
(1, 'KP', 'excellent service - saved me hours waiting in the urgent care centre as my gp was closed.', '05.jpg', 'yes'),
(2, 'HY', 'I had a great experience! The doctor was very courteous and friendly, and I was able to get a prescription filled right then and there.', '05.jpg', 'yes'),
(3, 'TA', 'I visited this pharmacy after forgetting to pack my medication &ndash; the doctor quickly assessed my needs and provided me with a prescription which was ready for me to collect moments later &ndash; I don&rsquo;t know what I would have done with out MedicSpot. Thank you!', '05.jpg', 'yes'),
(4, 'PJ', 'Dr Khaled was very kind and most helpful in her consultation.  I truly appreciated her service.  Thank you.', '05.jpg', 'yes'),
(5, 'NL', 'Ability to speak to a doctor quickly instead of having to wait for an appointment with my GP.', '05.jpg', 'yes'),
(6, 'BG', 'Excellent service. Thank You so much.', '05.jpg', 'yes'),
(7, 'LC', 'On the spot consultation, nice GP. Thank You', '05.jpg', 'yes'),
(8, 'PK', 'Immediate consultation and solution to problem, but it is a private service.', '04.jpg', 'yes'),
(9, 'SD', 'DR TOOR WAS GREAT! THANK YOU.', '05.jpg', 'yes'),
(10, 'RM', 'Wish they had locations near where I work, but otherwise great service.', '04.jpg', 'yes'),
(11, 'PC', 'An innovative experience &ndash; great for patients like myself who was not able to get an immediate appointment and was in need of medical advice and medication only available via prescription.', '05.jpg', 'yes'),
(12, 'LV', 'Needed antibiotics for a urine infection and had them within 20 mins.', '05.jpg', 'yes'),
(13, 'AI', 'I was very impressed with this service, as well as with Dr. Toor&rsquo;s care. As a tourist to Glasgow, I was very pleased that MedicSpot&rsquo;s &lsquo;information technology&rsquo; has helped me get the care I need. Many thanks.', '05.jpg', 'yes'),
(14, 'AI', 'I was very impressed with this service, as well as with Dr. Toor&rsquo;s care. As a tourist to Glasgow, I was very pleased that MedicSpot&rsquo;s &lsquo;information technology&rsquo; has helped me get the care I need. Many thanks.', '05.jpg', 'yes'),
(15, 'AF', 'The doctor was very helpful, thorough and professional.', '05.jpg', 'yes');
