INSERT INTO `teams` (`id`, `name`, `title`, `bio`, `avatar_image`, `published`, `category_id`) VALUES
(1, 'Dr Zubair Ahmed', 'CO-FOUNDER & CEO', 'Zubair read medicine at the University of Aberdeen and subsequently trained to be a GP and worked as a GP both in England and Scotland. He realised that primary healthcare provision could be made much more efficient and safer through the use of technology; which led to the launch of MedicSpot. He strongly believes that innovation has the potential to increase capacity in our health system whilst also improving the quality of care.\r\n<br>\r\nDr Ahmed is passionate about solving health challenges that we face through creativity and innovation. He holds a MBA from London Business School.', 'zubair2.png', 'yes', 3),
(2, 'Dr Tarlochan Toor', 'CO-FOUNDER & MEDICAL DIRECTOR', 'Following his medical studies at Guy&rsquo;s, King&rsquo;s and St Thomas&rsquo;s School of Medicine, Dr Toor completed his medical training at the Leeds Teaching Hospitals before qualifying as a GP. During his time in the NHS, Dr Toor saw first hand the problems faced by the NHS and patients alike. To help further understand the healthcare landscape and how better to deliver world-class healthcare, Dr Toor completed a Master&rsquo;s degree in Health Economics and Financing from the London School of Economics.\r\n<br>\r\nDr Toor is passionate about embracing technology and innovation to deliver the highest quality, patient-centred healthcare. He is responsible for ensuring MedicSpot has patient experience and safety at its very core.', 'team-people/f-tt.png', 'yes', 3),
(3, 'Oliver Brooks', 'CHIEF TECHNOLOGY OFFICER', 'Oliver has founded and run companies in different industries ever since graduating from University . He brings with him a wealth of experience in technical know-how, security, marketing and leadership skills to MedicSpot. Oliver feels that technology and innovation has a large role to play in improving our health system and is hoping that MedicSpot leads this change. Oliver holds a MET (Engineering) from Queens&rsquo; College, Cambridge.', 'team-people/f-ob.png', 'yes', 3),
(4, 'Jurek Sikorski', '', 'Jurek has extensive experience within the healthcare industry. After founding and exiting Boots-Celltech, Jurek became Sales & Marketing Director at Wellcome Diagnostics and Smith & Company, a FTSE 100 company. He progressed onto CEO roles at biotechnology companies before leading a medical devices start-up to successful IPO.\r\n<br>\r\nJurek is chairman of several companies and founder of Henley Business Angels.', '335f7a0.jpg', 'yes', 4),
(5, 'Jacques de Cock', '', 'Jacques has over 20 years experience in global consulting, technology, business creation and management. He is a founding director of Spicer and Openheim consultants and was CEO of Patsystems which he took from a 6 man start-up to a &pound;200m IPO in 3 years.\r\n<br>\r\nHe is currently CEO and partner at a business services firm, early stage advisory and a financial services consulting company. Jacques is also a trustee of 2 charities.', '00d3773.jpg', 'yes', 4),
(6, 'Dr Zubair Ahmed', 'MBChB mRCGP MBA', 'Dr Ahmed has been a doctor for 10 years after obtaining his medical degree from the University of Aberdeen, Scotland. He worked across a wide array of specialities including cardiology, accident and emergency, geriatrics before focusing his energies in becoming a General Practitioner. Dr Ahmed is very excited about how technology can help both doctors and patients alike.', 'zubair2.png', 'yes', 5),
(7, 'Saleem Arif', '', 'Saleem founded QualitySolicitors, the UK&rsquo;s first and largest legal brand with several hundred branches nationwide and now making up 5% of the entire private client legal market. Prior to founding QualitySolicitors, Saleem worked as a marketing consultant at McKinsey & Company and an equities broker at Merrill Lynch.\r\n\r\nSaleem read Economics and Cambridge and has a MBA from London Business School.', 'AAEAAQAAAAAAAAQMAAAAJDZiYmQyZjRlLTFmNGItNGMyZi05MGMzLTdhMWJhZDc3NWI5Mw.jpg', 'yes', 4),
(8, 'Nicholas Ibery', '', 'Nicholas is a co-founder and a senior advisor to MedicSpot. He is an investor with a particular interest in life sciences, focusing on social impact and sustainable investments. Nicholas holds degrees and postgraduate qualification in both medicine and law. He holds bachelors degrees in Medicine and LL.B in Law, specialising in corporate legal practice, Master&rsquo;s degree from the Imperial College and MBA from London Business School.', 'AAIA_wDGAAAAAQAAAAAAAAzdAAAAJGIxMDNhMjVhLTgyMjYtNGNiNS1iYTQ1LTNhMjQ2ZThiNDAxNw.jpg', 'yes', 4),
(9, 'Dr Tarlochan Toor', 'MBBS BSc(Hons) MSc MRCGP', 'Dr Toor graduated from Guy&rsquo;s, King&rsquo;s and St Thomas&rsquo; School of Medicine during which time he also completed an Intercalated BSc in Physiology. He completed his GP Training in Yorkshire and remained actively involved in teaching. He served as a Mentor to medical students and was appointed to Visiting Lecturer at the University of Leeds during his training.\r\n\r\nHe continues to serve as an NHS GP from his central London practice. He has a passion for Digital Health and hopes to continue in his resolve to provide the highest quality care using innovation and technology.', 'team-people/d-tt.png', 'yes', 5),
(10, 'Dr Faiza Khalid', 'Med Sci (Hons) MB ChB MRCGP PGCME', 'Dr Khalid has 12 years of experience as a GP. Born and raised in the Home Counties, she pursued her passion for medical sciences at The University of Leeds. She proceeded to read her degree in Medicine at The Leicester-Warwick Medical School. In addition to being a GP, she is also a qualified GP trainer and thus mentors doctors wishing to pursue a career in General Practice.', 'team-people/d-fk.png', 'yes', 5),
(11, 'Dr Wasif Razzaq', 'MBChB mRCGP', 'Dr Razzaq is a GP based in the North East of England. He has extensive experience across many different hospital specialities including cardiology and paediatrics.\r\n\r\nHowever, Dr Razzaq loves the variety encountered as a GP and enjoys providing a holistic management plan for his patients.', 'team-people/d-wr.png', 'yes', 5),
(12, 'Dr David Eckersall', 'MBChB mRCGP', 'Dr Eckersall attended Aberdeen Medical School, Scotland and subsequently completed his GP training in Newcastle. Whilst he greatly enjoyed his time in hospital working across various specialities, Dr Eckersall enjoyed the variety and holistic approach seen in general practice. Dr Eckersall is also a GP partner at a training practice in Lanarkshire, Scotland.', 'team-people/d-de.png', 'yes', 5);
INSERT INTO `testimonials` (`id`, `name`, `desc`, `avatar_image`, `published`) VALUES
(1, 'Jacqueline', 'Excellent service - saved me hours waiting in the urgent care centre as my GP was closed.', 'Jacqueline.png', 'yes'),
(2, 'Kelly', 'I had a great experience! The doctor was very courteous and friendly, and I was able to get a prescription filled right then and there.', 'kelly2.png', 'yes'),
(3, 'Trevor', 'I made the appointment at 3pm and was seen at 3.30pm the same day.  Feeling much better now thanks!', 'trevor2.png', 'yes'),
(4, 'Michael', 'Very quick, very thorough consultation on my issue.&nbsp; Very happy with outcome.', 'michael2.png', 'yes'),
(5, 'Nolan', 'The station was so easy to use and the doctor had great bedside manner.', 'nolan2.png', 'yes');
